INSERT INTO dou_article VALUES('49','2','一带一路对于玻璃市场的带动有多大影响？','','<p style=\"line-height: 1.5em;\"><span style=\"font-family:宋体\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;自2015年以来我国重点推进“一带一路”、京津冀协同发展、长江经济带三大战略，是构建中国新空间，发力区域经济的最大亮点之一。但是有望撬动万亿级市场的“一带一路”战略在玻璃行业面前似乎业内人士看法不一，玻璃市场悲观情绪逐渐蔓延。</span></p><p style=\"line-height: 1.5em;\"><span style=\"font-family: 宋体\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-family:宋体\">耐耐观点：目前，国内玻璃行业形势严峻，产能过剩严重，特别是附加值不高的浮法玻璃。很多玻璃厂不景气，甚至处于亏损状态。下游房地产正处去库存阶段，由于房地产消化对象为两年前的工程所以预计两年内下游需求处于低位状态，与此同时生产、环保成本的增加无疑为原片玻璃市场带来了多重限制因素。</span></p><p style=\"line-height: 1.5em;\"><span style=\"font-family: 宋体\">&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">多年来我国玻璃行业总产量位居世界第一，实际产量也相对过高但是市场对其需求量却在逐渐下降，企业效益不佳。在此背景下，业内人士表示，通过实施“走出去”战略来消化过剩产能。发展目标与战略定位上，要以本土化发展为主转向国际、国内两个市场并重，寻求新的经济增长点，树立“走出去”发展理念，充分利用国内外资源和市场，实现真正的国际化经营。</span></p><p style=\"line-height: 1.5em;\"><span style=\"font-family: 宋体\">&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">然而，目前国内玻璃企业率先“走出去”的并不多。不难看出，真正‘走出去’的玻璃企业其实不多，热情也不高，因为玻璃厂投资都比较大，产品利润也很薄，去国外风险还很大，没有一定实力的企业成为了巨大挑战，难以跨出这一步。</span></p><p style=\"text-indent: 28px; line-height: 1.5em;\"><span style=\"font-family:宋体\">不过，也有一些新型玻璃企业表示看好“一带一路”市场。‘一带一路’大战略的推进无疑对产能过剩的玻璃行业来说是有利的事，但怎么才能真正搭上这趟‘顺风车’也很考验人。去国外建设玻璃厂投资很大，因此一定要对当地市场需求判断准确，一旦需求跟不上，那收回成本就很困难，更不要谈收益了。</span></p><p style=\"line-height: 1.5em;\"><span style=\"font-family: 宋体\">&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">据调查，建设一条普通浮法玻璃生产线最少要投资2亿元左右，在玻璃市场表现良好的情况下，2年可以收回成本，但如今中国基建以及房地产等需求不那么大，情况就更不乐观了。若走出去的为原片玻璃这种技术含量较低的产品，这对于企业来说无疑是巨大的挑战，而且存在一定的风险。但附加值高的产品就不一样。以防火玻璃为例，防火玻璃只有欧洲少数国家做得比较好，其他国家很少生产，这意味着东南亚、中东以及以进口为主的欧洲国家都蕴含着重大机遇。</span></p><p style=\"text-indent: 28px; line-height: 1.5em;\"><span style=\"font-family:宋体\">其中具有代表性的便是享有“中国玻璃城”之称的河北沙河，作为中国最大的玻璃生产加工基地，沙河正在积极谋求产业转型升级，许多企业渴望“走出去”谋求更大发展。</span></p><p style=\"text-indent: 28px; line-height: 1.5em;\"><span style=\"font-family:宋体\">玻璃行业经历30多年的快速发展后，转变发展方式已成为必然的趋势和要求。在发展目标与战略定位上，要树立“走出去”发展的理念，充分利用国内外资源和市场，实现真正的国际化经营。以产能合作促进产业结构调整是一条可持续发展之路。</span></p><p><br/></p>','','建材行业政策解读','1458028396','8','','0','耐耐云商');
INSERT INTO dou_article VALUES('48','2','焦化市场走出迷局的新道路','','<p style=\"line-height: 1.5em;\"><span style=\"font-family:宋体\">&nbsp; &nbsp; &nbsp; &nbsp;近日，行业组织正式对外发布的《焦化行业“十三五”发展规划纲要》明确，“十三五”期间，焦化行业将淘汰全部落后产能，满足准入标准的产能占比要达到70%以上。由此可见，国内焦化行业将进入一个加速淘汰整合期，焦化市场也将迎来诸多变数。</span></p><p style=\"text-indent: 28px; line-height: 1.5em;\"><span style=\"font-family:宋体\">15</span><span style=\"font-family:宋体\">年，是“十二五”的最后一年，也是为“十三五”规划正式实施做出铺垫的关键年。根据中国炼焦行业协会统计，截至2015年底，规模以上企业焦炭总产能达6.87亿吨；企业由2010年的730多家减少到602家；企业平均焦炭产能规模从68万吨提升到114万吨。截至2015年底，国家公告了10批420家准入焦化企业，其间撤销了26家，实际准入企业367家（含新增产能企业），实际准入焦炭产能3.7766亿吨。</span></p><p style=\"text-indent: 28px; line-height: 1.5em;\"><span style=\"font-family:宋体\">耐耐观点：本网观点，顺应国家相关政策，加强环保意识并立即行动起来，才是焦企发展的新道路。</span></p><p style=\"text-indent: 28px; line-height: 1.5em;\"><span style=\"font-family:宋体\">一直以来，焦化企业都是让人又爱又恨，不得不承认它为经济发展级我国工业化进程所做出的贡献，但是由此带来的环境污染、大气污染等相关负面影响也是不容忽视的。15年，雾霾这个词语已经成为我们日常谈论的话题，雾霾高发频发，焦化企业有着不可推卸的责任。因此，随着《化境保护法》和《大气污染防治法》等法律法规的相继颁布实施，焦化企业的环境蒋彦强度无疑会越来越大，得到的地方保护和环境纵容则会越来越少，不排除因一次违规排放被群众举报，立刻停产甚至退出行业的可能。</span></p><p style=\"text-indent: 28px; line-height: 1.5em;\"><span style=\"font-family:宋体\">目前在一些焦化大省，有许多企业不仅存在着环境准入问题，例如相关环保准入审批未通过就先行投产开工生产，而且还有许多企业的环保相关设施存在不全或年久失修等问题。随着“十三五”规划限排指标审查的趋紧趋严，这些企业唯一的生存之道就是挤也要挤出资金来搞环保，否则等待他们的就是被迫关停，永远的退出这个行业。</span></p><p style=\"text-indent: 28px; line-height: 1.5em;\"><span style=\"font-family:宋体\">当然了，由于之前欠下的债，现在大力建设环保设施一定是要花费大量的人力物力财力的，所以在减轻环境污染的同时，也要加速去产能，积极开拓下游市场，延伸焦炭、焦油和焦炉气等化工行业的产业链，并且积极利用副产优势，大力开发副产品的产业链，实现以副业贴主业，最终形成双主业的生产经营格局。或许这条道路将带动不少企业走上创新、高效、高利用率的新道路。</span></p><p><br/></p>','','化工行业政策解读','1458028213','6','','0','耐耐云商');
INSERT INTO dou_article VALUES('47','2','耐材类行业现投资风险评估','','<p style=\"text-indent: 28px; line-height: 1.5em;\"><span style=\"font-family:宋体\">中国作为资源性大国，铝土矿、菱镁矿和石墨的资源储量丰富，同时下游钢铁、冶金、化工等行业也是国家重要支撑行业，对耐火材料的需求巨大。</span></p><p style=\"text-indent: 30px; line-height: 1.5em;\"><strong><span style=\"font-family:宋体\">回顾</span>2015</strong><strong><span style=\"font-family:宋体\">年耐火材料行业发展历程</span></strong></p><p style=\"text-indent: 28px; line-height: 1.5em;\"><span style=\"font-family:宋体\">统计数据显示，</span>2015<span style=\"font-family:宋体\">年中国钢铁总产量近</span>12<span style=\"font-family:宋体\">亿吨，而市场需求仅</span>7<span style=\"font-family:宋体\">亿吨，市场供求严重失衡，产能利用率不足</span>70%<span style=\"font-family:宋体\">。全国范围内钢铁市场行情低迷，这对于耐火行业而言无疑是重创。</span></p><p style=\"text-indent: 28px; line-height: 1.5em;\"><span style=\"font-family:宋体\">受到钢铁市场的影响较为严重，因为</span>2015<span style=\"font-family:宋体\">年耐材行业的运行情况困难重重：</span></p><p style=\"text-indent: 28px; line-height: 1.5em;\"><span style=\"font-family:宋体\">第一，产能过剩，供求失衡：耐材行业本身就存在产能过剩的问题，即使钢铁行业对耐材需求正常的时候，耐材行业本身的产能利用率也达不到百分之百；</span></p><p style=\"text-indent: 28px; line-height: 1.5em;\"><span style=\"font-family:宋体\">第二，技术门槛过低，产品重复率高：很多小微企业没有研发技术，没有创新能力和创新人才，一味地模仿别人，别人生产什么他就生产什么，市场创新率较低；</span></p><p style=\"text-indent: 28px; line-height: 1.5em;\"><span style=\"font-family:宋体\">第三，小微企业过多，缺乏有序管理：耐火材料小微企业多以个人、家庭等作坊形势存在，生产效率较低，产品质量参差不齐，且缺乏整体有序化管理，市场运作形势混乱；</span></p><p style=\"text-indent: 28px; line-height: 1.5em;\"><span style=\"font-family:宋体\">第四，环境污染严重：部分耐材生产企业没有使用环保设备，产品生产过程中造成的粉尘、气体等污染物较多，对环境带来的污染影响较大，且由于企业分散存在，不利于统一管理。</span></p><p style=\"text-indent: 28px; line-height: 1.5em;\"><span style=\"font-family:宋体\">基于上述原因，</span>2015<span style=\"font-family:宋体\">年我国耐火材料行业发展受到了一定的限制。耐火材料作为钢铁、有色、建材的重要基础材料，不可或缺。但是根据目前我国的下游需求来看，普通耐材制品的市场基本处于饱和状态，高端产品仍旧依赖于进口，主要是国内的产品技术和产品质量达不到要求造成的。</span></p><p style=\"text-indent: 28px; line-height: 1.5em;\"><span style=\"font-family:宋体\">但是，</span>2015<span style=\"font-family:宋体\">年耐火行业的相关管理办法的制定也给行业带来了新的契机。</span></p><p style=\"text-indent: 28px; line-height: 1.5em;\">2015<span style=\"font-family:宋体\">年《中国耐火材料行业“十三五”发展规划建议》编制工作完成，《规划》旨在帮助耐火材料企业认识并把握面对的经济形势和下游产业运行态势，避免耐火材料产业的不合理投资，引导耐火材料行业向健康可持续方向发展。</span></p><p style=\"text-indent: 28px; line-height: 1.5em;\"><span style=\"font-family:宋体\">同年</span>10<span style=\"font-family:宋体\">月，工业和信息化部正式印发了《耐火材料行业规范公告管理办法》。《耐火材料行业规范条件》和《耐火材料行业规范公告管理办法》的实施和推进落实，对耐火材料行业在“十三五”期间切实提高产业生产水平和创新能力，创建一流的企业、开发一流的技术、生产一流的产品、营造一流的环境，早日实现由大变强的发展目标具有重要意义。</span></p><p style=\"text-indent: 30px; line-height: 1.5em;\"><strong><span style=\"font-family:宋体\">困境之下，</span>2016</strong><strong><span style=\"font-family:宋体\">倒逼行业创新</span></strong></p><p style=\"text-indent: 28px; line-height: 1.5em;\"><span style=\"font-family:宋体\">在困境倒逼下，我国耐材行业或面临整合重组的趋势。</span>2016<span style=\"font-family:宋体\">年春节后，耐火行业企业开工率底下，不乏倒闭、转行者。</span></p><p style=\"text-indent: 28px; line-height: 1.5em;\"><span style=\"font-family:宋体\">耐火行业主要受困于下游需求方面的影响，同时自身产能过剩，短期内这种供需矛盾和恶性竞争的局面那以改善。</span></p><p style=\"text-indent: 28px; line-height: 1.5em;\">2016<span style=\"font-family:宋体\">年</span>2<span style=\"font-family:宋体\">月份，国家安全监管总局办公厅关于印发《陶瓷生产和耐火材料制造企业粉尘危害专项治理工作方案》，对于耐火行业的粉尘污染提出了相应的控制措施和治理方案。从这个角度来看，国家对于耐火行业对环境所带来的污染管控将更加严格，这对于未来耐火行业发展是一个信号，提示企业大力开发绿色、低耗、高寿命耐材，顺应市场需求。</span></p><p style=\"text-indent: 28px; line-height: 1.5em;\"><span style=\"font-family:宋体\">我国耐火行业想要渡过这段困难阶段，需要进行产业转型升级，加大企业间的合作，互补短长，提高产业集中度，适应当下我国的经济新常态。</span></p><p style=\"text-indent: 30px; line-height: 1.5em;\"><strong><span style=\"font-family:宋体\">市场风险分析</span></strong></p><p style=\"text-indent: 28px; line-height: 1.5em;\"><span style=\"font-family:宋体\">针对耐火材料行业存在的风险有如下几点：</span></p><p style=\"text-indent: 28px; line-height: 1.5em;\"><span style=\"font-family:宋体\">第一，需求风险：当前我国下游市场对于普通耐材制品的供需处于失衡状态，供过于求的局面难以打破，长此以往销售局面难以打开。但是目前行业兼并重组的情况比较多，小微企业竞争力较低，部分倒闭或停产，将会对产能的缩减起到一定的效果；</span></p><p style=\"text-indent: 28px; line-height: 1.5em;\"><span style=\"font-family:宋体\">第二，价格风险：同种产品生产经营者众多，同行之间存在恶意竞争的情况，且目前国家对原料矿产方面抓得很严，同时涉及到环保问题，企业生产成本会相应增加；但是目前主要推进自动化、智能化生产，相应人工成本减少，如果价格过低利润空间会被压缩，如果价格过高不被市场接受，产品销售会成问题；</span></p><p style=\"line-height: 1.5em;\"><span style=\"font-size:14px;font-family:宋体\">第三，技术风险：目前我国低端耐火材料市场已接近满荷状态，生产企业众多，产能难以消耗；但高端耐材方面市场需求仍有较大发展空间，国内高端耐材的生产研发方面仍有空白，企业可尝试这一方面的生产研发投资项目。</span></p><p><br/></p>','','耐火材料 行业分析','1458028045','9','','0','耐耐云商');
INSERT INTO dou_article VALUES('51','2','国家发改委：五举措化解过剩产能','','<p style=\"line-height:150%\">1<span style=\"font-family:宋体\">月</span>12<span style=\"font-family: 宋体\">日，国家发改委就宏观经济运行数据召开新闻发布会。会上，国家发改委秘书长、新闻发言人李朴民表示，中央对化解产能过剩非常重视，提出了明确的要求，要依法为实施市场化退出创造条件，加快破产清算案件的审理，要落实财税支持、不良资产处理、失业人员再就业和生活保障以及专项奖补等措施。</span></p><p style=\"line-height:150%\">&nbsp;&nbsp;&nbsp; <span style=\"font-family:宋体\">李朴民同时表示，下一步，发改委在化解过剩产能方面将采取五大措施，包括严格控制增量、用市场的办法解决问题、带动优势产能走出去、营造良好市场氛围、将钢铁和煤炭行业作为改革重点。</span></p><p style=\"text-indent:28px;line-height:150%\"><span style=\"font-family:宋体\">耐耐观点：本网认为，大宗商品产能煤炭等等行业的产能过剩已成顽疾，下猛药才能有良效</span></p><p style=\"text-indent:28px;line-height:150%\"><span style=\"font-family:宋体\">对于水泥和有色金属行业来说，正是当前的写照。众所周知，水泥是国内供应过剩较为严重的行业，其产业集中度低、产品同质度高、市场竞争激烈的特性导致其价格不断下滑，行业盈利水平逐年走低。近几年，环保压力增强，生产成本上升，企业经营压力突出。</span></p><p style=\"text-indent:30px;line-height:150%\"><strong><span style=\"font-family:宋体\">严格控制增量</span></strong></p><p style=\"text-indent:28px;line-height:150%\"><span style=\"font-family:宋体\">近年来，我国钢铁、煤炭、电解铝、水泥、造船等行业产能过剩现象日益突出，如何化解过剩产能成为工业制造业特别是高耗能产业的迫切需求。就水泥行业而言，辽宁的水泥产能过剩达到</span>46%<span style=\"font-family:宋体\">左右，行业处于微利状态，部分企业亏损，水泥价格已经卖到近</span>20<span style=\"font-family:宋体\">年的最低水平。</span></p><p style=\"text-indent:28px;line-height:150%\"><span style=\"font-family:宋体\">以往入冬后，尽管因北方冬季施工量减少导致水泥市场需求疲软，但水泥生产企业仍会释放一定的产能。这种长期累积的效应不仅加剧了行业产能过剩危机，同时也给区域空气质量带来严重威胁。为寻求化解产能过剩的新出路，同时改善空气质量，水泥行业开始尝试错峰生产。水泥错峰生产的实行有效减轻了北方地区采暖季的环境压力。</span>2015<span style=\"font-family:宋体\">年冬天，水泥错峰生产的试行范围进一步扩大，这将对遏制产能严重过剩和增加企业效益发挥重要作用。</span></p><p style=\"text-indent:30px;line-height:150%\"><strong><span style=\"font-family:宋体\">用市场的办法解决问题</span></strong></p><p style=\"text-indent:28px;line-height:150%\"><span style=\"font-family:宋体\">习近平总书记</span>2015<span style=\"font-family:宋体\">年</span>11<span style=\"font-family: 宋体\">月在中央财经领导小组会议上强调，在适度扩大总需求的同时，着力加强供给侧结构性改革。李克强总理早</span>2015<span style=\"font-family:宋体\">年</span>11<span style=\"font-family:宋体\">月</span>17<span style=\"font-family: 宋体\">日在主持召开“十三五”《规划纲要》编制工作会议时再次强调，要在供给侧和需求侧两端发力促进产业迈向中高端。所谓“供给侧改革”指的是指发生在投入侧而非产出侧的改革，这是我国经济改革的一个重要的侧重点，这项改革对水泥行业来说意义远大。</span></p><p style=\"text-indent:28px;line-height:150%\"><span style=\"font-family:宋体\">推进供给侧改革将有助于修复水泥等大宗商品失衡的供需关系。通过供给侧改革，一些产能过剩的企业可能会受到政策限制，大规模的继续生产将会受到抑制，以此来提高产品质量、消耗库存，给市场产出带来积极影响。</span></p><p style=\"text-indent:28px;line-height:150%\"><span style=\"font-family:宋体\">此次提出的五项措施较为明确，有利于淘汰僵尸企业，更有助于通过政策面直接干预产能过剩行业的规模扩张，从而解决水泥等传统行业产能严重过剩的问题，进而激发企业活力，提升产业核心竞争力，提高全要素生产率。</span></p><p><br/></p>','','发改委 产能过剩','1458029839','9','','0','耐耐云商');
INSERT INTO dou_article VALUES('45','6','年后业务总监齐聚上海，参加业务培训会','','<p>&nbsp; &nbsp;<span style=\"font-size: 16px; font-family: 宋体, SimSun; color: rgb(0, 0, 0);\">&nbsp;2月16日，来自业务团队的五虎战将齐聚上海总部，就新的一年、新的突破、新的部署、新的起点进行战队总谋划。在会上，吴总详细的分解了各大区任务模块，组织编列了平台运营就：采购员之家、会务、仓储等新兴业务推广模式向业务团队负责人逐一讲解。在会上，刚回上海的马总也参与旁听了会议。（图一）2月22日晨，马总就公司战略布局与新形势下我公司的发展提出全新谋划与期许，同时也对之前的公司发展规划进行了简短总结。</span></p><p><span style=\"font-size: 16px; font-family: 宋体, SimSun; color: rgb(0, 0, 0);\"><img src=\"webkit-fake-url://b08a253d-35cb-4063-82f3-584b4b1570ff/application.pdf\"/></span></p>','images/article/5e4215fc4c7bd1578e26904934304c30.png','业务总监 培训','1458025015','14','','0','耐耐云商');
INSERT INTO dou_article VALUES('46','2','钢铁行业风险评估','','<p style=\"line-height: 1.5em;\"><span style=\";font-family:宋体;color:#333333\">&nbsp; &nbsp;&nbsp;</span><span style=\";font-family:宋体;color:#333333\">钢铁行业作为国民经济重要的基础性产业,对我国的经济建设起着十分突出的作用。然而近年来我国钢铁行业经历了前所未有的困难,冶金原材料价格高企、钢材价格大幅下降、企业资产负债率上升等不利因素导致钢铁企业的盈利能力持续性下滑,严重影响了钢铁行业的平稳健康发展。　</span></p><p style=\"line-height: 1.5em;\"><span style=\";font-family:宋体;color:#333333\">　　据中国钢铁工业协会统计,2013年协会重点统计钢铁企业实现销售收入36875.6亿元,实现利润228.86亿元,销售利润率仅0.62%,低利润率客观反映了行业产能过剩的困境,为此,2013年国家出台了一系列政策,把化解产能严重过剩矛盾作为产业结构调整的重点,狠抓大气治理和节能减排,这些举措将有效遏制新增产能的增加和现有产能的释放,有利于缓解钢材市场供大于求的矛盾,但由于化解过剩产能、调整结构需要相应的过程和时间,钢材市场供大于求的矛盾短期内难以扭转。</span></p><p style=\"line-height: 1.5em;\"><span style=\";font-family:宋体;color:#333333\">&nbsp;&nbsp;&nbsp; </span><span style=\";font-family:宋体;color:#333333\">全球钢铁需求放缓，和目前全球经济的发展阶段息息相关。从用钢强度的角度来看，经济发展对钢铁需求的影响可以分为五个阶段：经济发展前处于较低的用钢强度水平;随着经济快速发展拉动用钢强度快速提高，直至呈现峰值水平;随着工业化接近完成，用钢强度明显下降;最终达到相对稳定的水平。全球钢铁行业的产能过剩难以在短期内得到解决，这已经是一个既定的事实：需求方面，因为经济增速明显放缓不会有实质性增长;而供给方面，钢铁企业削减产能的行为将因其对经济和政治造成的巨大的负面影响而难以为继。</span></p><p style=\"line-height: 1.5em;\"><span style=\";font-family:宋体;color:#333333\">&nbsp;&nbsp;&nbsp; </span><span style=\";font-family:宋体;color:#333333\">中国钢铁消费量占全球消费近半，而其快速消费期已然走到尽头。另据数据显示，由于建筑活动减少，中国2014年钢铁需求下滑3.3%，至7.10亿吨，为自1995年以来首次负增长。该协会预测，中国2015年的钢铁需求将再减少0.5%。</span></p><p style=\"line-height: 1.5em;\"><span style=\";font-family:宋体;color:#333333\">&nbsp;&nbsp; &nbsp;</span><span style=\";font-family:宋体;color:#333333\">对于深陷产能过剩、价格低迷泥潭的钢铁行业而言，一组组数据无一不折射着这个行业当前所面临的艰难困境。</span></p><p style=\"line-height: 1.5em;\"><span style=\";font-family:宋体;color:#333333\">　　220万吨、214吨、219吨，这是我国最近三个月日均粗钢产量；6630万吨、6570万吨，则是我国今年3月和4月的钢铁产量。与持续攀升的产量相对应的是，钢铁行业利润率持续下滑至接近衰竭、库存增加、资产负债率进入高风险区域的现状。中国钢铁工业协会的统计显示，一季度大中型钢铁企业实现销售收入8758.5亿元，同比增长0.94％；实现利润24.86亿元，同比实现扭亏为盈，销售利润率为0.28％，亏损面为34.9％。1至3月份，实现利润分别为13.38亿元、9.98亿元、2.67亿元，其中，3月份行业亏损面达到45.3％。</span></p><p style=\"line-height: 1.5em;\"><span style=\";font-family:宋体;color:#333333\">&nbsp;&nbsp;&nbsp; </span><span style=\";font-family:宋体;color:#333333\">由于2011年、2012年连续两年巨亏，按照深交所相关规定被实行退市风险警示处理，鞍钢股份被更名为“ST鞍钢”，这不仅是鞍钢方面所始料不及，更引发证券市场一片哗然。</span></p><p style=\"line-height: 1.5em;\"><span style=\";font-family:宋体;color:#333333\">　　鞍钢股份的窘境不仅反映出2012年行业经营困局，通过多家钢铁研究机构发布的报告可知，尽管一季度钢铁行业盈利状况有所改善，但二季度我国钢铁业所处经济环境仍然严峻。兰格钢铁信息研究中心市场监测显示，截至5月17日，国内十大重点城市建筑钢材除个别市场小涨外，大部分城市市场价格均以下跌为主。订单滑落及需求持续不振，已迫使钢企不得不下调产品出厂价格。</span></p><p style=\"line-height: 1.5em;\"><span style=\";font-family:宋体;color:#333333\">　　然而，即便如此，国内钢铁企业依然难下减产的决心，在钢铁主业明显减亏的同时，高产量、高库存以及高矿价依然如影随形，挥之不去。中钢协常务副会长朱继民日前表示，随着二季度需求旺季的到来以及新一届政府开始履新，钢材市场需求将有所好转，但由于产能释放较快，成本上升压力大，钢铁企业“高成本、低盈利”的局面短期内难以改变。</span></p><p style=\"line-height: 1.5em;\"><span style=\";font-family:宋体;color:#333333\">&nbsp;&nbsp;&nbsp; </span><span style=\";font-family:宋体;color:#333333\">可以预见的是，在环保政策加码的背景下，钢铁企业也将面临更大的难关。</span></p><p style=\"line-height: 1.5em;\"><span style=\";font-family:宋体;color:#333333\">&nbsp;&nbsp;&nbsp; 2016</span><span style=\";font-family:宋体;color:#333333\">年1月27日，国务院月内第三次召开会议，引导金融机构调整信贷政策，支持工业企业增效升级。具体而言，引导金融机构基于“运作是否规范(环保安全等角度)、是否具有债务清偿能力”两个标准，对企业实施差异化信贷政策—“有压缩有支持”。对于钢铁行业，中债资信观点如下: </span></p><p style=\"line-height: 1.5em;\"><span style=\";font-family:宋体;color:#333333\">　　其一，“压缩”—首次明确银行压缩退出相关贷款的标准，银行对钢铁行业僵尸企业的不良贷款处置将逐步提速。在之前政策吹风的基础上，此次会议首次明示两条标准，即对“长期亏损、失去清偿能力或环保、安全生产不达标且整改无望的企业及落后产能，坚决压缩退出相关贷款，支持化解过剩产能”。从政策标准看，中央仅从顶层制定“定性标准”，给政策执行留有空间，避免“一刀切”带来更大的问题。从政策影响看，尽管考虑地方政府层面的利益诉求、银行自身层面清收难度大、不良率提升压力等，银行对僵尸企业的不良贷款处置仍可能是渐进过程。但中期看，一方面，伴随供给侧改革的实质推进，僵尸企业生存空间逐步压缩，将倒逼银行加快不良贷款处置，另一方面，不良资产证券化等处置手段的逐步推广，亦将为银行处置不良贷款提供支撑，综合看，银行将逐步加快对钢铁行业僵尸企业的不良贷款处置速度。 </span></p><p style=\"line-height: 1.5em;\"><span style=\";font-family:宋体;color:#333333\">　　其二，“支持”—“支持运作规范、偿债有保障的企业发行公司信用债调整债务结构”。从政策影响看，符合标准的企业融资渠道(包括股权及债券融资、应收账款融资等)有望拓宽，直接融资比例将上升。 </span></p><p style=\"line-height: 1.5em;\"><span style=\";font-family:宋体;color:#333333\">　　总体看，伴随供给侧改革进入实操阶段，钢铁企业融资渠道及融资成本将加速分化。产能落后、运作不规范以及盈利能力弱、自身偿债能力差、严重依赖外部资金支持的钢铁企业，或将面临融资环境收紧引致的周转不畅，进而面临违约或破产风险。</span></p><p><br/></p>','','','1458027811','8','','0','耐耐云商');
INSERT INTO dou_article VALUES('44','6','五虎战队誓师大会','','<p style=\"line-height:150%\"><strong>&nbsp; &nbsp; &nbsp;&nbsp;</strong><span style=\"font-family: 宋体, SimSun; color: rgb(0, 0, 0); font-size: 16px;\">上周我公司业务团队各区域领导，继续在总部进行培训与学习。就业务本身、运营平台管理以及客户营销推介等不同板块展开大讨论、深度研究。</span></p><p><img src=\"webkit-fake-url://347ed887-bd9e-4284-8beb-4d0ee6b3a18e/application.pdf\"/></p><p>&nbsp; <span style=\"font-size: 16px; font-family: 宋体, SimSun; color: rgb(0, 0, 0);\">&nbsp;<span style=\"font-size: 16px; font-family: 宋体, SimSun;\">最终在周五举行了“耐耐云商科技有限公司·业务部门誓师大会”。会议在吴总、宗总主持领导下召开。首先，总部职能部门率先承诺配合运营平台打好未来市场拓广的攻坚战。活动在五虎战将的签字誓师时达到高潮。活动最后，公司领导为美好未来共同举杯！</span></span></p><p><span style=\"font-size: 16px; font-family: 宋体, SimSun; color: rgb(0, 0, 0);\"><span style=\"font-size: 16px; font-family: 宋体, SimSun;\"><img src=\"webkit-fake-url://a0d58190-a0ec-4df6-bac0-1ccb7f7ce25e/application.pdf\"/></span></span></p>','','业务部 誓师大会','1458024760','14','','0','耐耐云商');
INSERT INTO dou_article VALUES('43','7','中国耐火协会会长冯运生莅临公司参观指导，并做相关指导报告','','<p>&nbsp; &nbsp; &nbsp; &nbsp; 3<span style=\"font-family: 宋体;\">月</span>11<span style=\"font-family: 宋体;\">日，中国耐火协会会长冯运生先生应邀来访参观耐耐云商科技有限公司上海总部，受到耐耐云商科技有限公司董事长马成先生的热情接待。马成先生带领冯运生先生参观了公司并讲解了耐耐云商有限公司近几年的发展及未来的规划。冯运生先生在参观完公司后给耐耐云商上海总部的全体员工做了一场精彩的演讲。</span><br/></p><p><span style=\"font-family:宋体\">&nbsp; &nbsp; &nbsp; &nbsp; 冯运生先生用幽默风趣的语言，深入浅出的给大家介绍了耐火行业的历史和发展以及现状，也给大家介绍了作为耐火材料的领军品牌金隅通达的发展历程。正是追求卓越、精益求精的企业精神，金隅通达由原来的默默无闻发展到如今的年产十个多亿的规模，并为耐火材料行业的技术进步和产业升级做出了新的贡献。</span></p><p><span style=\"font-family:宋体\">&nbsp; &nbsp; &nbsp; &nbsp; 冯运生先生认为，在当前全国经济形式的影响下，工业行业进入产业结构全面调整的阶段，工业企业普遍面临产能过甚严峻的情况。但是这对于工业企业来说这是一场危机，但也是一起发展的契机。在这场危机中将淘汰很多产能低下的企业，将市场、资本和发展机会更多的聚集向高产能的企业。因而我们要坚定不移地推动工业企业的改革发展，坚定不移地摒弃原来的不合理、低效的产业模式，坚定不移地加快企业的转型升级。</span></p><p><span style=\"font-family:宋体\">&nbsp; &nbsp; &nbsp; &nbsp; 冯运生先生在演讲中称赞，耐耐云商是一个充满新生力量的团队。耐耐云商服务于传统工业行业，虽然受全球经济的影响，中国工业行业包括耐火材料在内的各个领域都处于低迷阶段，但是耐耐云商立志于用互联网思维和互联网手段促进并且帮助中国工业企业进行改革发展。这对于耐耐云商来说这个是一个充满前景的目标，对于中国工业行业来也是一个契机。</span></p><p><span style=\"font-family:宋体\">&nbsp; &nbsp; &nbsp; &nbsp; 最后冯运生先生表示，希望耐耐云商科技有限公司能够为工业行业改革发展和行业进步作出贡献，在实现自己公司本身价值的同时也为工业企业贡献力量。</span></p><p><br/></p>','','冯运生 耐火协会 参观指导','1458024428','28','3月11日耐火协会会长冯运生莅临公司参观指导，并作重要讲话','0','');
INSERT INTO dou_article VALUES('50','2','八部委：加大金融支持有色、钢铁等工业力度','','<p style=\"text-indent: 2em;\"><span style=\"font-size: 14px;font-family: 宋体\">据悉，中国人民银行、发展改革委、工业和信息化部、财政部、商务部、银监会、证监会、保监会八部委日前联合印发《关于金融支持工业稳增长调结构增效益的若干意见》（以下简称《意见》），从加大货币信贷政策支持、加大资本市场、保险市场对工业企业的支持力度，推动工业企业融资机制创新、促进工业企业兼并重组等方面提出了一系列推动工业转型升级、降本增效的金融政策措施。</span><span style=\"font-size: 12px;font-family: &#39;sans serif&#39;\"><br/> </span><span style=\"font-size: 14px;font-family: 宋体\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">意见表示，落实差别化工业信贷政策，引导银行业金融机构完善信贷准入标准，加大对战略性新兴产业、传统产业技术改造和转型升级等的支持力度。鼓励银行业金融机构在风险可控前提下，适当降低新能源汽车、二手车的贷款首付比例。引导银行业金融机构对钢铁、有色、建材、船舶、煤炭等行业中产品有竞争力、有市场、有效益的优质企业继续给予信贷支持，帮助有前景的企业渡过难关。</span><span style=\"font-size: 12px;font-family: &#39;sans serif&#39;\"><br/> </span><span style=\"font-size: 14px;font-family: 宋体\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">八部委此举引导银行业金融机构对钢铁、有色等行业中的优质企业进行信贷支持，在当前工业市场运行缓慢的形势下无异于雪中送炭，能够帮助企业在困境中谋生存、求发展，为企业解决资金方面的困扰。但是这对于“僵尸企业”而言相当于一记重击，从这种角度而言，能够清理工业企业市场环境，促进市场优胜略汰的优化过程。</span><span style=\"font-size: 12px;font-family: &#39;sans serif&#39;\"><br/> </span><span style=\"font-size: 14px;font-family: 宋体\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">众所周知的是，钢铁、有色等行业是耐火材料行业最主要的下游行业，八部委的此项《意见》无异于是带来了利好的消息。下游市场需求自去年起一直处于低迷态势，在钢铁市场去产能的大形势下更是显得毫无挣扎之力，这对于2015年的耐火市场而言，无异于阴霾重重。在这种形势下，小的耐火厂倒闭者众多，大中型企业也都出现了减产的情况，营业额同比有所下降。</span><span style=\"font-size: 12px;font-family: &#39;sans serif&#39;\"><br/> </span><span style=\"font-size: 14px;font-family: 宋体\">&nbsp; &nbsp; &nbsp; &nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">本次《意见》出台之后，或将加快钢铁、有色等市场的兼并重组进度，促进行业优化，使得钢铁市场、有色市场等恢复生机。对于耐火市场而言，下游市场需求面打开，产品自然不愁销路，将带动耐材市场的重新发展。</span><span style=\"font-size: 12px;font-family: &#39;sans serif&#39;\"><br/> </span><span style=\"font-size: 14px;font-family: 宋体\">&nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">目前耐火市场也面临着优胜略汰的淘汰过程，在未来的一段时间内，这种优胜略汰的过程还将继续存在。国家目前积极推进“中国制造2025”，耐火企业应积极响应国家号召同时顺应市场需求，研发高新绿色产品，以促进企业在逆势中赢得发展。</span></p>','','耐材行业政策解读','1458028585','5','','0','耐耐云商');
INSERT INTO dou_article VALUES('52','2','工信部副部长：利用市场倒逼加速过剩产能退出','','<p style=\"line-height: 1.5em; text-indent: 2em;\"><span style=\"font-family: 宋体; font-size: 16px;\">“经过 ‘十二五’的努力，淘汰落后产能取得了明显成效，提前一年完成了‘十二五’设定的淘汰落后产能目标任务。”日前，工业和信息化部副部长冯飞回顾了“十二五”期间我国在去产能方面取得的成就和亮点。</span></p><p style=\"line-height: 1.5em; text-indent: 2em;\"><span style=\"font-family: 宋体; font-size: 16px;\">他指出，“十二五”期间我国淘汰落后产能的力度非常之大。主要是在钢铁、建材、有色金属、轻工、纺织和食品六大领域19个行业淘汰落后产能。这些落后产能的退出对于化解过剩矛盾、污染防治起到一定作用，也为企业的发展，地方的发展腾出了土地、环境等一些稀缺资源。结构调整取得了一定的进步。</span></p><p style=\"line-height: 1.5em; text-indent: 2em;\"><span style=\"font-family: 宋体; font-size: 16px;\">冯飞指出，“十二五”期间，我国出现了明显的产能过剩问题，特别是像钢铁、水泥、平板玻璃、电解铝、船舶等行业出现了严重的产能过剩。</span></p><p style=\"line-height: 1.5em; text-indent: 2em;\"><span style=\"font-size: 16px; font-family: 宋体;\">&nbsp;而随着经济下行压力的加大，市场需求的回落，钢铁、煤炭、水泥这些行业产能严重过剩的矛盾进一步加大，这是在快速发展过程中长期积累的矛盾，将导致供求关系失衡，产品价格下降，企业经营困难加剧。产能过剩矛盾的问题必须予以解决，同时从资源环境的角度来考虑，有一些产能高耗能、高污染，所以在“十二五”期间我国加快了去产能的步伐。</span></p><p style=\"line-height: 1.5em; text-indent: 2em;\"><span style=\"font-family: 宋体; font-size: 16px;\">耐耐观点：钢铁、煤炭、水泥等行业产能严重过剩，打破了供求关系平衡发展，市场走向恶性竞争局面。看似机械设备并没有涉及其中，其实不然。</span></p><p style=\"line-height: 1.5em; text-indent: 2em;\"><span style=\"font-size: 16px; font-family: 宋体;\">&nbsp;近几年，下游煤炭、水泥等行业产能突出，机械设备销量大增，不少机械设备生产企业快速发展起来。但如今市场供大于求，不少企业没有订单，堆货积压，生产难以继续支撑，选择停产，这直接影响了机械设备的销量，不少机械设备企业2015年订单大大减少，这使得机械设备生产厂家紧张起来；另一方面，产能过剩，企业货物难出，盈利困难，对于机械设备采购价格也大大压低，低价采购现象普遍，使得机械设备市场价格混乱，价格战严重；还有不少企业分期付款，回款问题严重，甚至也有不少设备企业难以维持生产，选择停产观望。</span></p><p style=\"text-indent: 2em; line-height: 1.5em;\"><span style=\"font-size: 16px; font-family: 宋体;\">&nbsp;&nbsp;&nbsp; 在需求不振、供给过快的前提下，倒逼加速过剩产能退出是必然的变化过程，而压减的方式，主要还是通过市场倒逼，市场出清机制起决定性作用。同时政府采取激励和兜底的政策。通过去产能可以恢复到比较合理的水平，最重要的表现是产品价格的上升，这样企业的经营状况才会好转，企业的创新能力才能恢复。过剩产能退出将有利于煤炭、水泥等行业市场平稳发展，同时也会平衡设备市场稳定发展。</span></p><p><br/></p>','images/article/638e955f05ba7ef8455f9b26262a63c5.jpg','产能过剩 市场倒逼','1458030050','9','','0','耐耐云商');
INSERT INTO dou_article VALUES('53','3','3月份钢市表现向好','','<p style=\"text-indent: 2em; line-height: 150%;\"><span style=\"font-size:14px;line-height:150%;font-family:宋体\">市场已经进入3月份，钢价在稍作修正后，局部市场又重现拉涨之势，在降准等宏观刺激以及期货强劲反弹的带动下，市场信心再次得以提升。</span></p><p style=\"text-indent: 2em; line-height: 150%;\"><span style=\"font-size: 14px;line-height: 150%;font-family: 宋体\">局部钢价再度拉涨开启年后第二波反弹</span></p><p style=\"text-indent: 2em; line-height: 150%;\"><span style=\"font-size: 14px;line-height: 150%;font-family: 宋体\">从3月份第一个交易日来看，</span><span style=\"font-size:14px;line-height:150%;font-family:宋体\">建材市场尚显偏弱。<span style=\"color:windowtext\">重庆</span>、<span style=\"color:windowtext\">贵阳</span>、<span style=\"color:windowtext\">兰州</span>以及石家庄等市场仍有10-20元小幅下滑，但华东市场大部、<span style=\"color:windowtext\">广州</span>、<span style=\"color:windowtext\">武汉</span>以及沈阳市场出现小幅反弹，幅度多在10元左右，其它市场总体平稳为主。全国24个三级螺纹钢市场报价也仅上涨1元，其中上海三级螺纹拉至1970元/吨，北京市场稳定在1930元/吨。进入本周，建材市场库存增加比较明显，螺纹和线材较节前均增加了25%以上，市场商家心理存在压力。另一方面，建材钢厂复产快于板材，市场资源加重。不过，建材报价总体还是维持较好的态势，下游开工路略晚于预期，下游启动比较慢，与市场报价差距偏大。</span></p><p style=\"text-indent: 2em; line-height: 150%;\"><span style=\"font-size: 14px;line-height: 150%;font-family: 宋体\">从板材市场看，热卷、</span><span style=\"font-size:14px;line-height: 150%;font-family:宋体\">中厚板企稳态势巩固，局部报价开始回升。在热卷市场，上海、<span style=\"color:windowtext\">南京</span>、<span style=\"color:windowtext\">郑州</span>、武汉、长沙、广州一线，以及大部分华北、东北市场都出现10-30元不等的涨幅，仅成都、兰州市场报价小幅回调。上周回调比较大的<span style=\"color:windowtext\">合肥</span>、<span style=\"color:windowtext\">济南</span>、<span style=\"color:windowtext\">福州</span>等地则保持平稳。4.75热卷上海报价约为2080－2090元/吨，乐从市场报价约为2130元/吨左右，天津市场报价约为2020元/吨左右。长沙市场由于资源短缺商家拉涨强烈，部分商家报价涨幅达到50元。</span></p><p style=\"text-indent: 2em; line-height: 150%;\"><span style=\"font-size: 14px;line-height: 150%;font-family: 宋体\">耐耐观点：相关资料显示，刚刚过去的2月份中国钢铁行业PMI为45.2%，环比回升2.3个百分点，连续三个月回升至2014年5月份以来的最高点。虽然仍处于荣枯线以下，但从分项指标来看，除新出口订单、供应商配送时间和国外原材料采购指数出现下降，原材料库存指数持平外，其余指数全面回升。二月份正值春节，生产</span><span style=\"font-size:14px;line-height:150%;font-family:宋体\">企业例行检修，其达产率降至历史低位，导致节后市场库存低位，带动钢价迎来自十二月份起的第二轮反弹，进而影响原材料价格。目前钢厂生产利润尚可，2月份新订单指数为46.6%，环比上升4.4个百分点，说明钢厂订单有了明显好转。经历了2015年一整年去库存阶段，钢厂库存降至历史性低点，导致节后市场冬储库存量偏低，激发节后市场订货积极性，新订单指数出现明显上升。</span></p><p style=\"text-indent: 2em; line-height: 150%;\"><span style=\"font-size: 14px;line-height: 150%;font-family: 宋体\">上周末央行再降存准率，使货币进一步宽松，并激发起一线城市新的购房热，对房地产市场有一定促进，对增强钢市信心有一定利好。由于今年1-2月份信贷明显高于去年，宽松资金会推动大宗商品继续向好，并有助于恢复钢市需求。不过2月份中国制造业采购经理指数（PMI）为49.0%，低于上月0.4个百分点，制造业仍然是整体经济向好的软肋。分企业规模看，大型企业PMI为49.9%，比上月下降0.4个百分点，位于临界点以下；中型企业PMI为49.0%，与上月持平，仍低于临界点；小型企业PMI为44.4%，比上月下降1.7个百分点，持续位于收缩区间。终端采购仍然乏力。需求仍需要继续观察。</span></p><p style=\"text-indent: 2em;\"><span style=\"font-size: 14px;font-family: 宋体\">总体上看，3月份开市，钢市继续表现向好。在宽松资金面以及政策推动去产能进一步落实的情况下，有利于钢市供需矛盾进一步缓解，如果后期市场需求得以升温，将进一步推升钢价走高。</span></p><p><br/></p>','','钢材 回暖','1458031642','9','','0','耐耐云商');
INSERT INTO dou_article VALUES('54','3','玻璃行业市场表现不一，浮法原片稳中有升','','<p style=\"line-height: 1.5em; text-indent: 2em;\"><span style=\"font-size: 16px;\"><span style=\"font-family: 宋体;\">2016年3月8日安全4.5mm报价10.9元/平方米；3.8mm报价8.6元/平方米，较上一交易日价格而言无太大变动。厂家产销率逐渐增加，春节期间囤积的库存量明显减少。沙河市场较其他地区而言具有一定的优势。近期报价一直趋于稳中有升的局面，分析上涨原因主要有三点：1、纯碱供应局面紧张，价格自春节以来一直处于上涨趋势，这也致使玻璃成本随之增加；2、春节期间库库存量一直居于高位，小幅度调整报价来刺激经销商提高进货量；3、深加工企业已基本恢复停产，下游需求逐渐增加，对玻璃原片市场有所带动。预计短期内玻璃报价仍处于小幅调整的状态。</span><span style=\"font-family: 宋体; line-height: 150%; text-indent: 0em;\">但是相较于小板市场而言，浮法大板表现略逊一筹，价格无太大波动，产销率也一直处于较低状态。春节开市一周后，厂家为刺激出库量小幅下调报价，但是效果一般。由于大板应用领域具有的一定的局限性，所以使得近期市场交投氛围清淡，预计短期内仍以持稳为主。</span></span></p><p style=\"text-indent: 2em; line-height: 1.5em;\"><span style=\"font-size: 16px; font-family: 宋体;\">深加工方面，据本网了解2016年元宵过后，深加工企业陆续开工，由于下游终端市场动力不足，今年深加工厂家存在“放假早、开工晚”的现象，需求启动十分缓慢，厂家、经销商走货速度滞缓，而生产线正常在产，库存有增无减。&nbsp;部分企业停产转让,当前多数加工企业的订单数量小于同期，整体呈现较为平淡的开年局面，也给市场人士的市场信心造成一定压力，短期内呈弱势状态。</span></p><p><br/></p>','','建材 玻璃','1458031750','8','','0','耐耐云商');
INSERT INTO dou_article VALUES('55','3','振动筛市场简析','','<p style=\"line-height: 150%; text-indent: 2em;\"><span style=\"font-family: 宋体\">3</span><span style=\"font-family:宋体\">月初，了解到河南生产能力4t/h，电机功率0.55Kw，筛网规格0.12mm振动筛报价在7000-8000元，相比2月同期，报价无波动，</span></p><p style=\"line-height: 150%; text-indent: 2em;\"><span style=\"font-family:宋体\">振动筛主要用于耐火、矿山、选煤、选矿、建材、电力及化工产品筛选、分级。而如今受钢铁市场的冲击，耐火、矿山、冶金等各个行业受到严重影响，钢铁厂所剩无几，耐火原料使用有限，加之环保力度加大，不少耐火企业已难以维持选择停产观望，振动筛采购明显减少。目前来看，河南振动筛生产厂商较多，振动筛价格也参次不齐，由于技术水平低或者功能选择不一，振动筛价格已处于混乱状态。市场冷淡，竞争激烈，企业若想越过难期，必须加强技术水平，生产先进设备，质量保证的同时，方便于客户。</span></p><p><br/></p>','','设备 振动筛','1458033268','8','','0','耐耐云商');
INSERT INTO dou_article VALUES('56','3','萤石市场弱势平稳发展，年内难有较大变化','','<p style=\"line-height: 150%; text-indent: 2em;\"><span style=\";line-height:150%;font-family:宋体\">本周国内萤石市场价格小幅下滑，国内7%萤石湿粉主流出厂含税报价均价在1482元/吨，区间在1350-1500元/吨居多，不含税价格区间在1100-1400元/吨，但实际成交仍有空间，如内蒙地区老客户送到价在1450元/吨，本周实际成交有50-100元/吨的下滑。萤石区域性价格差距较大，北方地区受天气影响停车较多，目前平均开工仅有三成。</span></p><p style=\"line-height: 150%; text-indent: 2em;\"><span style=\";line-height:150%;font-family:宋体\">耐耐观点：目前萤石块主要供应萤石粉，钢铁行业需求持续萎缩；萤石粉虽然相对而言比较平稳，但整体表现仍呈弱势，国内萤石市场行情不佳，且各地成交价格差距较大萤石粉下游氢氟酸市场虽有窄幅提高，但成交量并无明显好转，估计涨价情况也属底各大企业为降低亏损的联合行为，行业开工率不高，减产降幅相对增加，导致对萤石市场的需求低迷，因而对萤石采购不足；下游氟化铝疲软运行，终端刚性需求明显减少，价格难涨，中间贸易商利润薄弱，退市明显，市场行情交投清淡，市场价格高报低走。萤石市场受下游利空因素影响价格一直处于低位水平。</span></p><p style=\"line-height: 150%; text-indent: 2em;\"><span style=\";line-height:150%;font-family:宋体\">本周萤石市场整体表现冷清，交投面难现利好，预计萤石出厂含税价格长期在1350-1450元/吨左右，实单仍有商谈空间，年内整体变化不大。</span></p><p><br/></p>','','冶金化工 萤石 市场弱势平稳','1458033391','7','','0','耐耐云商');
INSERT INTO dou_article VALUES('57','3','有色金属锡近期行情分析','','<p style=\"text-indent: 2em; line-height: 150%;\"><span style=\"font-family:宋体\">3</span><span style=\"font-family:宋体\">月4日，长江现货1#锡112000元/吨-114000元/吨，较3月3日上涨了4500元/吨。云南锡业1#锡出厂价为113500元/吨，价格较昨日有大幅提升。3月7日，长江现货1#锡报价为113000元/吨-115000元/吨，较3月4日上涨了1000元/吨，上海地区1#锡报价为113000元/吨，较3月4日基本持平。</span></p><p style=\"line-height: 150%; text-indent: 2em;\"><span style=\"font-family:宋体\">近期金属锡价格大涨，导致云锡价格过高，市场上买入低价货源较少，下游观望居多。厂家与部分持货商逢高出货，但市场流出货源有限且价格坚挺，低价货源难觅。</span></p><p style=\"text-indent: 2em; line-height: 150%;\"><span style=\"font-family:宋体\">近期，有色金属锡价格强势，究其原因：一是供给侧改革预期升温，去产能持续；二是央行降准，货币环境宽松；三是进入春季开工旺季，补库存需求提升。本网调查得知，目前金属锡下游行业虽已经基本恢复运行，但由于并不是行业消费旺季，且目前市面上货源暂时充足，因此后市价格或有小幅下降。</span></p><p><br/></p>','images/article/ecce9a112075bb465eed89dc4b0904b6.jpg','有色金属 锡','1458033580','8','','0','耐耐云商');
