INSERT INTO dou_page VALUES('1','about','0','企业简介','<img alt=\"\" src=\"http://company.nainaiwang.com/images/upload/image/20160324/20160324073531_43752.jpg\" /><br />\r\n<p style=\"text-indent:2em;font-family:Simsun;color:#666666;font-size:14px;\">\r\n	耐耐云商科技有限公司成立于2014年12月。\r\n</p>\r\n<p style=\"text-indent:2em;font-family:Simsun;color:#666666;font-size:14px;\">\r\n	公司与国内外众多知名生产资料企业建立了良好、稳固的合作伙伴关系。公司逐步形成强大的人才、技术和品牌优势， 并拥有一支朝气蓬勃，技术全面的团队，为适应公司快速发展和迈向国际化的需要，集团总部于2015年5月15日正式迁址上海市浦东新区唐镇电子商务创新港，现在北京、河北唐山、山西阳泉设立三大运营中心，并形成了保险、金融、市场、资源、技术五大支撑点。\r\n</p>\r\n<p style=\"text-indent:2em;font-family:Simsun;color:#666666;font-size:14px;\">\r\n	“聚合民族工业精髓，创建全球工业市场化服务平台”是公司的经营宗旨，在该宗旨的指导下，打造国内首家生产资料综合包含工业相关资料、制品及设备的电子交易系统、仓储物流服务系统以及互联网增值服务系统等。\r\n</p>\r\n<p style=\"text-indent:2em;font-family:Simsun;color:#666666;font-size:14px;\">\r\n	电子交易系统以竞拍、竞买、现价、邀约等新颖的交易方式呈献给各界同仁，共同分享世界财富。同时平台为客户提供 免费的技术支持、行业资讯、企业管理咨询等增值服务，持续向社会展示工业企业的新产品、新技术、新项目、新文化、新行情，促成企业资源共享，实现企业价值最大化。\r\n</p>\r\n<p style=\"text-indent:2em;font-family:Simsun;color:#666666;font-size:14px;\">\r\n	公司在竞争中求发展，在挑战中谋机遇，我公司会为您提供最优质的产品、最先进的技术和最完善的售后服务。愿与您携手并进、共创辉煌，实现中国工业企业的振兴！\r\n</p>','公司简介','公司简介');
INSERT INTO dou_page VALUES('7','product','0','公司动态','<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2016年3月21日德国比肯费尔德经贸局局长Dietz先生、德国比肯费尔德外管局副局Scherer先生、德国“橡树园”项目主创始人之一侯计香女士受邀参观国家电子商务综合创新实践区——上海浦东唐镇工业园。上海浦东唐镇工业园区相关负责人和工作人员表示热烈欢迎德国官员和侯女士的到来。\r\n</p>\r\n<p align=\"center\">\r\n	<img style=\"width:554px;height:394px;\" alt=\"\" src=\"http://company.nainaiwang.com/images/upload/image/20160415/20160415102525_38034.jpg\" width=\"508\" height=\"402\" /> \r\n</p>\r\n<p>\r\n	&nbsp;\r\n</p>\r\n<p>\r\n	上海唐镇电子商务产业发展有限公司副总经理、浦东电子商务协会副秘书长温锦文先生全面介绍了唐镇工业园区的发展情况、发展成就、发展前景、产业规划和投资环境。温总描述到唐镇地处上海浦东新区中心位置，全镇总面积32.16平方公里，全镇常住人口10万余人，交通便利，基础设计齐全，配套产业齐全。近年来，唐镇依托浦东新区作为上海国际金融、航运、贸易中心建设的主战场，兼具综合配套改革先行先试的优势，利用自身独特的区位特点和产业基础，大力推进电子商务创新港项目，建设电子商务产业积聚区。Dietz先生和Scherer先生对唐镇工业园区的建设和发展表示称赞和敬佩。\r\n</p>\r\n<p align=\"center\">\r\n	<img style=\"width:554px;height:563px;\" alt=\"\" src=\"http://company.nainaiwang.com/images/upload/image/20160415/20160415102853_97297.jpg\" width=\"746\" height=\"640\" /> \r\n</p>\r\n<p>\r\n	温总随后带领Dietz先生、Scherer先生和侯女士参观唐镇电子商务基地，重点介绍中国电子商务发展历程和现状，以及浦东新区在2010年成为国内首家“国家电子商务综合创新实践区”后，加快营造电子商务产业创新发展环境，搭理支持电子商务创新企业与园区建设，着力推进电子商务在贸易、旅游会展等服务经济发展中应用创新的资讯。\r\n</p>\r\n<p align=\"center\">\r\n	<img alt=\"\" src=\"http://company.nainaiwang.com/images/upload/image/20160415/20160415103039_66357.jpg\" /> \r\n</p>\r\n<p align=\"center\">\r\n	<img alt=\"\" src=\"http://company.nainaiwang.com/images/upload/image/20160415/20160415103143_45738.jpg\" /> \r\n</p>\r\n<p align=\"left\">\r\n	&nbsp;参观工业园区电子商务基地后，Dietz先生、Scherer先生和侯女士同塘镇政府领导一起开展座谈会。座谈会中，中共上海市浦东新区唐镇人民政府镇长卢刚先生，首先对德国比肯费尔德政府官员亲临塘镇工业园表示欢迎和感谢。其次介绍了工业区近些年的成就和变化，并强调工业区园区产业结构的优化升级始终离不开浦东新区的大力支持，与此同时卢镇长表示期待日后唐镇电子商务平台能与德国企业交流合作。\r\n</p>\r\n<p align=\"center\">\r\n	<img alt=\"\" src=\"http://company.nainaiwang.com/images/upload/image/20160415/20160415103233_86280.jpg\" /> \r\n</p>\r\n<p align=\"left\">\r\n	Dietz先生在座谈会中进行了PPT展示，详细介绍了德国莱法州比肯费尔德市优越的地理位置、人文环境、旅游生活、优良教育、交通等情况，并针对当地的经济贸易情况做了相关介绍，同时希望唐镇工业园区的企业到德国投资并开拓欧洲市场，加强中德之间的贸易往来。\r\n</p>\r\n<p align=\"center\">\r\n	<img alt=\"\" src=\"http://company.nainaiwang.com/images/upload/image/20160415/20160415103325_93984.jpg\" /> \r\n</p>\r\n<p align=\"left\">\r\n	座谈会结束后，Dietz先生、Scherer先生和侯女士受邀参观耐耐云商科技有限公司办公室。耐耐云商科技有限公司董事长马成先生介绍耐耐云商致力于创建全球工业市场化服务平台，为客户提供免费的技术支持、行业资讯、企业管理咨询等增值服务。Dietz先生和Scherer先生表示中国近年来电商发展迅猛，看到有如此丰富的电子商务服务平台，想必日后中国的电子商务一定能发展得更好，同时希望中国电子商务企业能进入德国市场，加强中国和德国之前的交流与合作，互惠共利。\r\n</p>\r\n<p align=\"center\">\r\n	<img alt=\"\" src=\"http://company.nainaiwang.com/images/upload/image/20160415/20160415103449_60457.jpg\" /> \r\n</p>\r\n<p align=\"left\">\r\n	&nbsp;最后Dietz先生、Scherer先生、侯女士同耐耐云商科技有限公司董事长马总以及塘镇相关领导人合影留恋。\r\n</p>\r\n<p align=\"center\">\r\n	<img alt=\"\" src=\"http://company.nainaiwang.com/images/upload/image/20160415/20160415103522_38300.jpg\" /> \r\n</p>\r\n<p align=\"center\">\r\n	&nbsp;\r\n</p>\r\n<p>\r\n	&nbsp;\r\n</p>','','');
INSERT INTO dou_page VALUES('8','service','0','产品服务','<h5 style=\"font-size:14px;color:#666666;text-indent:2em;font-family:Simsun;\">\r\n	免费服务\r\n</h5>\r\n<p style=\"color:#666666;text-indent:2em;font-size:14px;font-family:Simsun;\">\r\n	系列产品随机包含一年的免费服务，服务内容包括一年的系统软件升级服务、一年的硬件保修服务和一年的技术支持服务，服务起止时间从购买合同签订时间起到第365天。\r\n</p>\r\n<h5 style=\"font-size:14px;color:#666666;text-indent:2em;font-family:Simsun;\">\r\n	技术支持服务\r\n</h5>\r\n<p style=\"color:#666666;text-indent:2em;font-size:14px;font-family:Simsun;\">\r\n	对于所有服务期内的，所有的客户服务请求都会进入耐耐云商售后服务监控系统。作为故障排除流程，所有的请求和针对问题所发生的操作都会记录在服务监控系统中。售后服务监控系 统会不间断的更新以反映问题的所有权和状态。技术支持工程师和他们的经理每天都会监控他们的不正常问题，那些超过了正常反应或解决时间的问题会转到他们的管理层那里。\r\n</p>','','');
