INSERT INTO dou_page VALUES('10','contact','0','联系我们','<h1 style=\"text-indent:2em;font-family:Simsun;color:#666666;font-size:14px;\">\r\n	<br />\r\n<span style=\"color:#64451d;font-size:18px;\"><strong></strong></span>\r\n</h1>\r\n<h1 style=\"text-indent:2em;font-family:Simsun;color:#666666;font-size:14px;\">\r\n	<span style=\"color:#64451d;font-size:18px;\"><strong>对于任何问题，请随时通过邮件联系我们</strong></span> \r\n</h1>\r\n<p>\r\n	<br />\r\n</p>\r\n<p style=\"text-indent:2em;font-family:Simsun;color:#666666;font-size:14px;\">\r\n	地址：<span style=\"font-family:宋体;font-size:10.5pt;\">上海市浦东新区唐镇上丰路</span><span style=\"font-family:\'Times New Roman\';font-size:10.5pt;\">977</span><span style=\"font-family:宋体;font-size:10.5pt;\">号涛飞国际广场（电子商务港）</span><span style=\"font-family:\'Times New Roman\';font-size:10.5pt;\">B</span><span style=\"font-family:宋体;font-size:10.5pt;\">区</span><span style=\"font-family:\'Times New Roman\';font-size:10.5pt;\">8</span><span style=\"font-family:宋体;font-size:10.5pt;\">楼</span>\r\n</p>\r\n<p style=\"text-indent:2em;font-family:Simsun;color:#666666;font-size:14px;\">\r\n	电话：400-6238-086 传真：021-60459868\r\n</p>\r\n<p style=\"text-indent:2em;font-family:Simsun;color:#666666;font-size:14px;\">\r\n	邮编：201210\r\n</p>\r\n<p style=\"text-indent:2em;font-family:Simsun;color:#666666;font-size:14px;\">\r\n	企业电子邮箱：nnw@nainaiwang.com\r\n</p>\r\n<p style=\"text-indent:2em;font-family:Simsun;color:#666666;font-size:14px;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-indent:2em;font-family:Simsun;color:#666666;font-size:14px;\">\r\n	<iframe style=\"width:560px;height:362px;\" src=\"http://company.nainaiwang.com/admin/include/kindeditor/plugins/baidumap/index.html?center=121.667131%2C31.243385&zoom=17&width=558&height=360&markers=121.667131%2C31.243385&markerStyles=l%2CA\" frameborder=\"0\">\r\n	</iframe>\r\n</p>','','');
INSERT INTO dou_page VALUES('11','new3','8','交易平台','<p class=\"MsoNormal\">\r\n	<p class=\"MsoNormal\">\r\n		<b><span style=\"font-family:宋体;font-size:16px;\">&nbsp;&nbsp;&nbsp;<img alt=\"\" src=\"http://company.nainaiwang.com/images/upload/image/20160324/20160324044604_74739.jpg\" />&nbsp;&nbsp;&nbsp;&nbsp;</span></b> \r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		<b><span style=\"font-family:宋体;font-size:16px;\"><span style=\"font-size:18px;\">现货挂牌交易</span></span></b><span style=\"font-family:宋体;font-size:12pt;\"><span style=\"font-size:18px;\">：</span><span></span></span> \r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		<span style=\"font-family:宋体;font-size:12pt;\"></span>\r\n	</p>\r\n	<p style=\"text-indent:24pt;\" class=\"MsoNormal\">\r\n		<span style=\"font-family:宋体;font-size:12pt;\"><span style=\"font-size:16px;\">现货挂牌交易是指在交易市场组织下，卖双方不见面，买方或卖方通过交易市场</span><span style=\"font-size:16px;\"><span style=\"font-size:16px;\">现货</span></span><span style=\"font-size:16px;\">挂牌</span><span style=\"font-size:16px;\"><span style=\"font-size:16px;\">电子交易</span></span><span style=\"font-size:16px;\">系统，将可供需商品的品牌、规格等主要属性和交货地点、交货时间、数量、价格等信息对外发布要约，由符合资格的对手方提出接受该要约的申请，进行集中竞价买卖，统一撮合成交，统一结算付款，并通过交易市场签订电子</span><span style=\"font-size:16px;\"><span style=\"font-size:16px;\">购销合同</span></span><span style=\"font-size:16px;\">，按合同约定进行实物交收，充分解决了现货商品交易的客户源、在线结算、物流配送等众多难题的一种交易模式。</span><span></span></span> \r\n	</p>\r\n	<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n		<span style=\"font-size:16px;\">&nbsp;</span> \r\n	</p>\r\n	<p style=\"text-indent:25.95pt;\" class=\"MsoNormal\">\r\n		<b><span style=\"font-family:宋体;font-size:18px;\">竞价交易</span></b><span style=\"font-family:宋体;font-size:12pt;\"><span style=\"font-size:16px;\">：</span><span></span></span> \r\n	</p>\r\n	<p style=\"text-indent:24pt;\" class=\"MsoNormal\">\r\n		<span style=\"font-family:宋体;font-size:12pt;\"></span>\r\n	</p>\r\n	<p style=\"text-indent:24pt;\" class=\"MsoNormal\">\r\n		<span style=\"font-family:宋体;font-size:12pt;\"><span style=\"font-size:16px;\">一、竞价交易：是指在交易市场组织下，买方或卖方通过交易市场现货竞价交易系统，将可供需商品的品牌、规格等主要属性和交货地点、交货时间、数量、底价等信息对外发布要约，由符合资格的对手方自主加价或减价，按照</span><span style=\"font-size:16px;\">“</span><span style=\"font-size:16px;\">价格优先</span><span style=\"font-size:16px;\">”</span><span style=\"font-size:16px;\">的原则，在规定时间内以最高买价或最低卖价成交并通过交易市场签订电子购销合同，按合同约定进行实物交收的交易方式。分为竞买专场和竞卖专场。</span><span></span></span> \r\n	</p>\r\n	<p style=\"text-indent:24pt;\" class=\"MsoNormal\">\r\n		<span style=\"font-family:宋体;font-size:12pt;\"><span style=\"font-size:16px;\">二、竞价交易成交的原则</span><span></span></span> \r\n	</p>\r\n	<p style=\"text-indent:24pt;\" class=\"MsoNormal\">\r\n		<span style=\"font-family:宋体;font-size:16px;\">1</span><span style=\"font-family:宋体;font-size:12pt;\"><span style=\"font-size:16px;\">、成交时</span><span style=\"font-size:16px;\"><span style=\"font-size:16px;\">价格优先</span></span><span style=\"font-size:16px;\">的原则</span><span></span></span> \r\n	</p>\r\n	<p style=\"text-indent:24pt;\" class=\"MsoNormal\">\r\n		<span style=\"font-family:宋体;font-size:12pt;\"><span style=\"font-size:16px;\">买进申报</span><span style=\"font-size:16px;\">:</span><span style=\"font-size:16px;\">较高价格者优先； 卖出申报</span><span style=\"font-size:16px;\">:</span><span style=\"font-size:16px;\">较低价格者优先。</span><span style=\"font-size:16px;\"><span style=\"font-size:16px;\">申买价</span></span><span style=\"font-size:16px;\">高于即时揭示</span><span style=\"font-size:16px;\"><span style=\"font-size:16px;\">最低卖价</span></span><span style=\"font-size:16px;\">，以最低申卖价成交；申卖价低于最高申买价，以最高申买价成交。两个委托如果不能全部成交，剩于的继续留在单上，等待下次成交。</span><span></span></span> \r\n	</p>\r\n	<p style=\"text-indent:24pt;\" class=\"MsoNormal\">\r\n		<span style=\"font-family:宋体;font-size:16px;\">2</span><span style=\"font-family:宋体;font-size:12pt;\"><span style=\"font-size:16px;\">、成交时间优先的原则</span><span></span></span> \r\n	</p>\r\n	<p style=\"text-indent:24pt;\" class=\"MsoNormal\">\r\n		<span style=\"font-family:宋体;font-size:12pt;\"><span style=\"font-size:16px;\">买卖方向、价格相同的，先申报者优先于后申报者。先后顺序按交易主机接受、申报的时间确定。</span><span></span></span> \r\n	</p>\r\n	<p style=\"text-indent:24pt;\" class=\"MsoNormal\">\r\n		<span style=\"font-family:宋体;font-size:12pt;\"></span>\r\n	</p>\r\n	<p style=\"text-indent:25.95pt;\">\r\n		<b><span style=\"font-size:18px;\">协商交易：</span><span></span></b> \r\n	</p>\r\n	<p style=\"text-indent:24pt;\">\r\n		<span style=\"font-size:16px;\">协商交易是指双方就成交</span><span style=\"font-size:16px;\"><span style=\"font-size:16px;\">价格</span></span><span style=\"font-size:16px;\">、数量等其他合同要素进行协商，然后通过交易市场签订购销合同并进行实物交割的交易方式。协商交易的特点</span><span style=\"font-size:16px;\">1</span><span style=\"font-size:16px;\">．交易形式更为灵活，更适应大宗买卖的协商交易；</span><span style=\"font-size:16px;\">2</span><span style=\"font-size:16px;\">．同时适合秘密协商交易</span><span></span> \r\n	</p>\r\n	<p style=\"text-indent:25.95pt;\" class=\"MsoNormal\">\r\n		<b><span style=\"font-family:宋体;font-size:16px;\">招投标</span></b><span style=\"font-family:宋体;font-size:12pt;\"><span style=\"font-size:16px;\">：</span><span></span></span> \r\n	</p>\r\n	<p style=\"text-indent:24pt;\" class=\"MsoNormal\">\r\n		<span style=\"font-family:宋体;font-size:12pt;\"><span style=\"font-size:16px;\">招标和投标是一种商品交易行为，是交易过程的两个方面。招标投标是一种国际惯例，是商品经济高度发展的产物，是应用技术、经济的方法和市场经济的竞争机制的作用，有组织开展的一种择优成交的方式。 </span><span></span></span>\r\n	</p>\r\n	<p style=\"text-indent:24pt;\" class=\"MsoNormal\">\r\n		<span style=\"font-family:宋体;font-size:12pt;\"><span style=\"font-size:16px;\">这种方式是在货物、工程和服务的采购行为中，招标人通过事先公布的采购和要求，吸引众多的投标人按照同等条件进行平等竞争，按照规定程序并组织技术、经济和法律等方面专家对众多的投标人进行综合评审，从中择优选定项目的中标人的行为过程。其实质是以较低的价格获取最优的货物、工程和服务。</span><span></span></span> \r\n	</p>\r\n	<p style=\"text-indent:24pt;\" class=\"MsoNormal\">\r\n		<span style=\"font-family:宋体;font-size:12pt;\"><span style=\"font-size:16px;\">电子招投标是以制度为基础、以网络为介质、以信用为保障、以交易为驱动、以监管为秩序的电子商务生态系统，他有一套全新的运行规则，其推行的意义也不仅仅在于生产效率的提升或实现了传统产业工具化，更重要的是，它为招投标行业的商业环境带来划时代变革。</span><span></span></span> \r\n	</p>\r\n	<p style=\"text-indent:24pt;\" class=\"MsoNormal\">\r\n		<span style=\"font-family:宋体;font-size:12pt;\"><span style=\"font-size:16px;\">耐耐云商电子商务平台帮助企业零成本获得开放平台的市场位置，允许招标机构免费利用平台资源。既将招标机构置身于一个科学决策、动态管理的运营环境中，让招标机构能够对自身业务发展有真实、科学的了解和认识。同时，平台还将招标机构置身于一个开放的网络市场中，并以网络的搜索和推送功能为招标机构提供更多机会，帮助招标机构转变企业经营管理观念，充分利用网络资源提升企业市场竞争力，实现企业跨越式的发展。</span><span></span></span> \r\n	</p>\r\n	<p>\r\n		<br />\r\n	</p>','','');
INSERT INTO dou_page VALUES('12','culture','1','企业文化','<p>\r\n	<span style=\"line-height:28px;font-size:16px;\">&nbsp;\r\n</p>\r\n<p align=\"center\">\r\n	<img style=\"width:337px;height:345px;\" alt=\"\" src=\"http://company.nainaiwang.com/images/upload/image/20160420/20160420103945_38896.png\" width=\"519\" height=\"495\" /></span><span style=\"line-height:28px;font-size:16px;\"> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">董事长寄语</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span> \r\n</p>\r\n<p style=\"text-align:left;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;font-weight:bold;\">CEO’s&nbsp;Words</span><span style=\"font-family:宋体;font-size:10.5pt;font-weight:bold;\"></span> \r\n</p>\r\n<p style=\"text-align:left;text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\">中国企业通过不断的完善、发展，已经以自己的状态向世界展现了我们的价值。即使中国小企业也在顽强找寻适合自身发展的环境，一旦环境对的话，沒准也会成为世界顶尖的企业。&nbsp;耐耐人秉承“聚合民族工业精髓，创建全球工业市场化服务平台”的理念，孜孜以求，免费开放耐耐网交易服务平台，希望我们的努力能为企业提供最佳的平台环境，耐耐网成为您最忠实的助手，我们也将会为您的选择感到骄傲和自豪！</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span> \r\n</p>\r\n</span> \r\n<p>\r\n	<span style=\"line-height:28px;font-size:16px;\"></span>&nbsp;\r\n</p>\r\n<p>\r\n	<span style=\"line-height:28px;font-size:16px;\"><img alt=\"\" src=\"http://company.nainaiwang.com/images/upload/image/20160324/20160324082937_19838.jpg\" /> \r\n</p>\r\n<p style=\"text-align:left;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:14px;\">1.企业的使命</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span> \r\n</p>\r\n<p style=\"text-align:left;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:14px;\">Corporate&nbsp;mission</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span> \r\n</p>\r\n<p style=\"text-align:left;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:14px;\">引导生产资料流通方向、改善融资环境、减少资源浪费、促进供需平衡</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span> \r\n</p>\r\n<p style=\"text-align:left;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:10.5pt;\"><span style=\"font-size:14px;\">To&nbsp;guide&nbsp;the&nbsp;flow&nbsp;of&nbsp;productive&nbsp;materials,&nbsp;improve&nbsp;financing&nbsp;environment,&nbsp;reduce&nbsp;the&nbsp;waste&nbsp;of&nbsp;materials&nbsp;and</span><span style=\"font-size:14px;\">promote&nbsp;a&nbsp;balanced&nbsp;supply&nbsp;and&nbsp;demand&nbsp;relation.</span></span><span style=\"font-family:宋体;font-size:10.5pt;\"></span> \r\n</p>\r\n<p style=\"text-align:left;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:14px;\">2.企业的核心价值观</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span> \r\n</p>\r\n<p style=\"text-align:left;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:14px;\">Corporate&nbsp;Core&nbsp;values</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span> \r\n</p>\r\n<p style=\"text-align:left;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:14px;\">互助、共赢、创新、高效</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span> \r\n</p>\r\n<p style=\"text-align:left;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:14px;\">Mutual&nbsp;help,&nbsp;win&nbsp;win,&nbsp;innovation&nbsp;and&nbsp;high&nbsp;efficiency</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span> \r\n</p>\r\n<p style=\"text-align:left;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:14px;\">3.公司愿景：</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span> \r\n</p>\r\n<p style=\"text-align:left;\" class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:14px;\">Corporate&nbsp;vision</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:14px;\">聚合民族工业精髓，创建全球工业市场化服务平台</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:宋体;font-size:14px;\">Bring&nbsp;together&nbsp;the&nbsp;essence&nbsp;of&nbsp;national&nbsp;industry&nbsp;and&nbsp;build&nbsp;a&nbsp;global&nbsp;service&nbsp;platform&nbsp;for&nbsp;marketization&nbsp;of&nbsp;industry.</span><span style=\"font-family:宋体;font-size:10.5pt;\"></span> \r\n</p>\r\n</span>','','');
INSERT INTO dou_page VALUES('13','development','1','发展历程','<span style=\"font-size:16px;\">\r\n<h4>\r\n	<b><span>2014</span></b><b>年<span></span></b>\r\n</h4>\r\n<p class=\"MsoNormal\">\r\n	<span>1</span>、阳泉交易中心<span>2014</span>年<span>5</span>月<span>15</span>日真金交易网启动发布会。<span></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>2</span>、<span>12</span>月耐耐云商科技有限公司正式成立。<span></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>3</span>、成为新密耐火协会常务理事。<span></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>4</span>、公司与中铝山东分公司、国家铝硅质检中心、中国人民财产保险公司、武汉科技大学材料与冶金院、北京诺亚舟财产咨询有限公司、上海沙钱信息技术有限公司、郑大信息技术有限公司、河南洛阳高温材料研究院达成长期合作。<span></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>&nbsp;</span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<h4>\r\n		<b><span>2015</span></b><b>年<span><br />\r\n</span></b>\r\n	</h4>\r\n<span>1</span>、北京分公司、唐山分公司成立。<span></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>2</span>、<span>2015</span>年<span>5</span>月<span>15</span>日公司集团总部正式迁址上海市浦东新区唐镇电子商务创新港。<span></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>3</span>、<span>2015</span>年<span>7</span>月<span>31</span>日在中国耐火之都——阳泉成功的举办了“现货交易转型，山西耐火产业联盟研讨峰会”；大型耐火企业高管、冶金企业负责人、特邀嘉宾、政府领导积极参与，市科技局领导致开场词。<span></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>4</span>、公司微信公众号正式上线。<span></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>5</span>、<span>2015</span>年<span>9</span>月<span>5</span>日著名家装及五金配件行业龙头<span>-----</span>崔总来我司考察。<span></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>6</span>、<span>2015</span>年<span>9</span>月<span>22</span>日 公司参与中国耐火材料行业协会第七次会员代表大会。<span></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>7</span>、<span>2015</span>年<span>10</span>月<span>30</span>日公司举办第一次表彰大会。<span></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>8</span>、<span>2015</span>年<span>11</span>月 我司联合众多科研单位及专家，为企业提供线上、线下技术咨询指导。解决企业生产、采购、管理、财务等各方面问题。<span></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>9</span>、<span>2015</span>年阳泉市陈市长莅临阳泉交易中心考察走访。<span></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>&nbsp;</span>\r\n</p>\r\n<h4>\r\n	<b><span>2016</span></b><b>年<span></span></b>\r\n</h4>\r\n<p class=\"MsoNormal\">\r\n	<span>1</span>、<span>2016</span>年<span>1</span>月<span>11</span>日 同济大学建筑学院院长周教授一行来访我公司。<span></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>2</span>、<span>2016</span>年<span>2</span>月公司推出人力资源全新布局“责权利”方案，完成公司人力改制。<span></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>3</span>、<span>2016</span>年<span>3</span>月公司组织召开“我是一切问题的根源”的价值观讨论大会。<span></span>\r\n</p>\r\n4、2016年3月3日360奇酷手机总裁祝芳浩一行来公司考察。</span> <span style=\"font-size:16px;\"></span><br class=\"Apple-interchange-newline\" />','','');
INSERT INTO dou_page VALUES('15','target','1','发展方向及目标','<span style=\"font-size:16px;\"><img alt=\"\" src=\"http://company.nainaiwang.com/images/upload/image/20160324/20160324072245_97758.jpg\" />“聚合民族工业精髓，创建全球工业市场化服务平台” 是公司的经营宗旨，在该宗旨的指导下，打造</span><br />\r\n<span style=\"font-size:16px;\">国内首家生产资料综合性服务平台，包含工业材料制品与设备的电子交易系统、仓储物流服务系统以及互</span><br />\r\n<span style=\"font-size:16px;\">联网增值金融服务系统等。</span><br />\r\n<span style=\"font-size:16px;\">&nbsp;&nbsp;&nbsp;&nbsp;电子交易系统以竞拍、竞买、现价、邀约等新颖的交易方式呈献给各界同仁，共同分享世界财富。同</span><br />\r\n<span style=\"font-size:16px;\">时平台为客户提供免费的技术支持、行业资讯、企业管理咨询等增值服务，持续向社会展示工业企业的新</span><br />\r\n<span style=\"font-size:16px;\">产品、新技术、新项目、新文化、新行情，促成企业资源共享，实现企业价值最大化。</span><br />\r\n<span style=\"font-size:16px;\">&nbsp;&nbsp;&nbsp;&nbsp;公司在竞争中求发展， 在挑战中谋机遇，我公司会为您提供最优质的产品、最先进的技术和最完善的</span><br />\r\n<span style=\"font-size:16px;\">售后服务。愿与您携手并进、共创辉煌，实现中国工业企业的振兴！</span><br />\r\n<span style=\"font-size:16px;\"></span><br class=\"Apple-interchange-newline\" />','','');
INSERT INTO dou_page VALUES('17','transport','8','仓储物流','<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<img alt=\"\" src=\"http://company.nainaiwang.com/images/upload/image/20160324/20160324050458_21848.jpg\" /><span style=\"font-size:16px;\"></span>\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">耐耐仓储联盟是一个创新的大宗商品现货，电子交易平台。耐耐仓储联盟向全国范围发起仓储企业联盟。遵从联盟仓库管理规范及作业流程，免费对接耐耐网现货交易平台，实现货物的在线交易。以存货作为在线交易的保证，以现货交易促进存货的流转，从而实现交易与物流的完美结合，带来更广阔的客户群体，创造联盟价值。</span><span></span> \r\n</p>\r\n<p style=\"text-indent:15.75pt;margin-left:5.25pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">目前耐耐网仓储物流有以下几大管理体系支持运营：</span><span></span> \r\n</p>\r\n<p style=\"text-indent:-21pt;margin-left:28.1pt;\" class=\"MsoListParagraph\">\r\n	<span style=\"font-size:16px;\"><strong>一、 </strong></span><span style=\"font-size:16px;\"><strong>数据管理</strong></span><span></span> \r\n</p>\r\n<p style=\"text-indent:21pt;margin-left:7.15pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">对整套可视化系统数据进行安全加密、维护、备份及灾难性恢复等功能，为用户提供安全可靠的数据存储。</span><span></span> \r\n</p>\r\n<p style=\"text-indent:-21pt;margin-left:28.1pt;\" class=\"MsoListParagraph\">\r\n	<span style=\"font-size:16px;\"><strong>二、 </strong></span><span style=\"font-size:16px;\"><strong>标准化管理</strong></span><span></span> \r\n</p>\r\n<p style=\"text-indent:0cm;margin-left:28.1pt;\" class=\"MsoListParagraph\">\r\n	<span style=\"font-size:16px;\">统一进行标准化代码管理，包括物品代码、货位代码和人员代码。</span><span></span> \r\n</p>\r\n<p style=\"text-indent:-21pt;margin-left:28.1pt;\" class=\"MsoListParagraph\">\r\n	<span style=\"font-size:16px;\">l&nbsp; 物品代码</span><span style=\"font-size:16px;\">----</span><span style=\"font-size:16px;\">严格按照有关规定标准进行物品定义和维护，使用时根据实际情况在该标准的基础上进行细化与补充。整个系统应用统一的物品代码，并具有物品代码增加、修改、查询、删除等功能。</span><span></span> \r\n</p>\r\n<p style=\"text-indent:-21pt;margin-left:28.1pt;\" class=\"MsoListParagraph\">\r\n	<span style=\"font-size:16px;\">l&nbsp; 货位代码</span><span style=\"font-size:16px;\">----</span><span style=\"font-size:16px;\">根据实际情况进行货位代码定义和维护，并具有代码增加、修改、查询、删除功能。</span><span></span> \r\n</p>\r\n<p style=\"text-indent:-21pt;margin-left:28.1pt;\" class=\"MsoListParagraph\">\r\n	<span style=\"font-size:16px;\">l&nbsp; 人员代码</span><span style=\"font-size:16px;\">----</span><span style=\"font-size:16px;\">提供建立不同岗位人员简明人事档案功能。为每个人员设置不同的代码，并根据岗位或职务设置不同的使用功能权限。</span><span></span> \r\n</p>\r\n<p style=\"text-indent:-21pt;margin-left:28.1pt;\" class=\"MsoListParagraph\">\r\n	<span style=\"font-size:16px;\"><strong>三、 </strong></span><span style=\"font-size:16px;\"><strong>模型管理</strong></span><span></span> \r\n</p>\r\n<p style=\"text-indent:0cm;margin-left:28.1pt;\" class=\"MsoListParagraph\">\r\n	<span style=\"font-size:16px;\">提供各种库房、物资及附属设施设备等的模型及相关数据、信息，让使用者能够清</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">晰直观地了解到库房内所有设施设备的基本情况与库房内部情况。</span><span></span> \r\n</p>\r\n<p style=\"text-indent:-21pt;margin-left:28.1pt;\" class=\"MsoListParagraph\">\r\n	<span style=\"font-size:16px;\"><strong>四、 </strong></span><span style=\"font-size:16px;\"><strong>日常业务管理</strong></span><span></span> \r\n</p>\r\n<p style=\"text-indent:21pt;margin-left:7.15pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">对物资出入库和存储阶段进行优化管理，如自动查找满足作业要求的物资，直观显示其所在位置，提供较为合理的出入库建议，自动生成作业单据，提高物资的流转效率。具体分为以下几个子模块：</span><span></span> \r\n</p>\r\n<p style=\"text-indent:-21pt;margin-left:28.1pt;\" class=\"MsoListParagraph\">\r\n	<span style=\"font-size:16px;\">l&nbsp; 入库作业与优化</span><span style=\"font-size:16px;\">----</span><span style=\"font-size:16px;\">根据不同的管理策略、货物属性、数量以及现有库存情况，自动设定货物堆码位置、货物堆码顺序建议，从而有效地利用现有仓库容量，提高作业效率。</span><span></span> \r\n</p>\r\n<p style=\"text-indent:-21pt;margin-left:28.1pt;\" class=\"MsoListParagraph\">\r\n	<span style=\"font-size:16px;\">l&nbsp; 在库管理</span><span style=\"font-size:16px;\">----</span><span style=\"font-size:16px;\">在库管理主要是指物品在库期间的日常管理、清查盘点、保管养护、存储时间检查，以及为了便于管理物品和更有效利用仓库容量而进行的并库、移库操作。</span><span></span> \r\n</p>\r\n<p style=\"text-indent:-21pt;margin-left:28.1pt;\" class=\"MsoListParagraph\">\r\n	<span style=\"font-size:16px;\">l&nbsp; 出库作业与优化</span><span style=\"font-size:16px;\">----</span><span style=\"font-size:16px;\">根据不同的管理策略、货物属性、数量以及现有库存情况，自动拣定组合、确定货物位置、货物拣选顺序建议。支持紧急拣选，对超过一定时间的产品进行优先拣选。</span><span></span> \r\n</p>\r\n<p style=\"text-indent:-21pt;margin-left:28.1pt;\" class=\"MsoListParagraph\">\r\n	<span style=\"font-size:16px;\">l&nbsp; 盘点管理</span><span style=\"font-size:16px;\">----</span><span style=\"font-size:16px;\">提供实盘数量与账面数量对比调整功能。</span><span></span> \r\n</p>\r\n<p style=\"text-indent:-21pt;margin-left:28.1pt;\" class=\"MsoListParagraph\">\r\n	<span style=\"font-size:16px;\">五、 </span><span style=\"font-size:16px;\">查询统计分析：对物流中心仓库物品所处状态进行查询，并可提供相关报表、进行</span><span></span> \r\n</p>\r\n<p style=\"margin-left:7.1pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">可视化货位显示和库存图表统计，为管理决策提供及时准确的数量信息，并能自动生成和打印报表。</span><span></span> \r\n</p>\r\n<p style=\"text-indent:-21pt;margin-left:28.1pt;\" class=\"MsoListParagraph\">\r\n	<span style=\"font-size:16px;\">六、 </span><span style=\"font-size:16px;\">实时监控：利用安放在库房内不同方位的摄像头，对库房内部实时进行监控，确保</span><span></span> \r\n</p>\r\n<p style=\"margin-left:7.1pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">物资存储的安全。</span><span></span> \r\n</p>\r\n<p style=\"margin-left:7.1pt;\" class=\"MsoNormal\">\r\n	<br />\r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">以工业供应链整合与优化为服务目标，深度探索工业物流特点，努力发展成为工业世界领先的物流供应商；以工业原料为主要服务对象，提供现代化物流管理与咨询、物流加工、仓储配送及其他相关增值服务。从而成功上市，为促进我国工业的快速发展做出贡献。</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<br />\r\n</p>\r\n<p style=\"text-indent:21pt;margin-left:5.25pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">现已经有山西，河南两大城市的企业加盟耐耐仓储联盟，在未来</span><span style=\"font-size:16px;\">1</span><span style=\"font-size:16px;\">年中耐耐会将联盟扩大到东北三省，江浙沪。未来</span><span style=\"font-size:16px;\">3</span><span style=\"font-size:16px;\">年覆盖全国。成为中国规模最大、服务最好、技术最先进的专业化、国际化的工业物流企业。</span><span></span> \r\n</p>','仓储物流联盟','');
INSERT INTO dou_page VALUES('18','safe','8','金融保险','<p class=\"MsoNormal\">\r\n	<img alt=\"\" src=\"http://company.nainaiwang.com/images/upload/image/20160324/20160324075602_15306.jpg\" />我公司办理各种保险产品，为您的产品、交易保驾护航。经营保险种类：产品责任险、第三者责任险、货运险、无理由退货险、产品质量险、信用保险，构建“以客户为中心”的服务平台和体系，与时俱进为客户提供行业领先水平的服务措施，以“关爱、专业、便利”的服务品牌赢得客户的信赖与赞誉。<span></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<br />\r\n</p>','','');
INSERT INTO dou_page VALUES('19','information','8','信息资讯','<p class=\"MsoNormal\">\r\n	<span style=\"line-height:2;font-size:16px;\">&nbsp; &nbsp; &nbsp; <img alt=\"\" src=\"http://company.nainaiwang.com/images/upload/image/20160324/20160324075157_33035.jpg\" />耐耐网信息咨询业务为客户提供网站六大行业（耐材、钢铁、冶金化工、建材、设备、其他）产品的行情分析，价格走势图，以及行情资讯等。此外还包括企业专属定制报告服务，软文写作服务。</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"line-height:2;font-size:16px;\"><strong>1.</strong></span><span style=\"line-height:2;font-size:16px;\"><strong>行情分析</strong></span> \r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"line-height:2;font-size:16px;\">包括六大行业（耐材、钢铁、冶金化工、建材、设备、其他）所有产品的市场行情分析，价格变动原因以及上下游行业对本行业产品的影响分析。为客户提供丰富的资讯平台，及时了解市场动态、价格波动等信息。</span><span></span> \r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<br />\r\n</p>\r\n<p style=\"text-indent:0cm;margin-left:0cm;\" class=\"MsoNormal\">\r\n	<b><span style=\"line-height:2;font-size:16px;\">2.</span></b><b><span style=\"line-height:2;font-size:16px;\">价格走势</span><span></span></b> \r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"line-height:2;font-size:16px;\">包括六大行业（耐材、钢铁、冶金化工、建材、设备、其他）所有产品的价格走势图，产品在一定周期内的价格波动以折线图的形式展示，一目了然。方便用户根据价格变动及时作出调整，改变企业了解价格变动不及时的问题。</span> \r\n</p>\r\n<p style=\"text-indent:0cm;margin-left:0cm;\" class=\"MsoNormal\">\r\n	<span style=\"line-height:2;font-size:16px;\">3.</span><b><span style=\"line-height:2;font-size:16px;\">行情资讯</span></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"line-height:2;font-size:16px;\">&nbsp;&nbsp;&nbsp; </span></b><span style=\"line-height:2;font-size:16px;\">汇聚海量行业资讯，统计数据，下游信息，热点新闻为客户提供实用丰富的资讯平台，及时了解市场动态，涉及六大行业信息，实现信息的有效流通；消除了企业上下游信息流通不畅的问题，实现资源和知识共享。</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"line-height:2;font-size:16px;\">4.</span></b><b><span style=\"line-height:2;font-size:16px;\">定制报告</span></b> \r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"line-height:2;font-size:16px;\">包括全国重点市场需求调查，根据各地区行业特点分析产销情况及发展趋势，企业规模、产品、总体效益、企业集中度、进出口贸易调查和宏观政策对企业影响的分析。可以根据客户需求定制报告内容。</span><span></span> \r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"line-height:2;font-size:16px;\">1）为了满足更多客户在不同发展阶段的不同需求，耐耐网可以依据客户的个性化需求，帮助客户完成符合需求的市场研究成果。</span><span></span> \r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"line-height:2;font-size:16px;\">2）我们会安排各行业领域的资深信息顾问或者资深调研人员组成项目调研小组去完成数据调研。</span><span></span> \r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"line-height:2;font-size:16px;\">3）耐耐网自身拥有庞大的数据库平台，一部分数据将在数据库中调取与重新核实，另外一部分数据将安排专业的市场调研人员进行数据挖掘与深度调研。</span><span></span> \r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"line-height:2;font-size:16px;\">4）各行业客户可根据不同行业特点指定报告内容和数据范围。经过行业资深人士的分析和研究，做出的对当前行业、市场的研究分析和预测。成为用户做重大市场决策的有力依据。</span><span></span> \r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"line-height:2;font-size:16px;\">5）报告内容涵盖了全国市场、重点区域、上下游情况，以及进出口贸易情况和国家的宏观政策影响，内容广泛，分析透彻。</span><span></span> \r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"line-height:2;font-size:16px;\">6）节省企业对市场的调研时间，定制报告可为用户提供最全面的实时数据。</span><span></span> \r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"line-height:2;font-size:16px;\">7）数据真实性，报告数据全部来自信息采编人员与全国客户核实后进行全面分析，保证报告数据的准确性。</span><span></span> \r\n</p>\r\n<p style=\"text-indent:0cm;margin-left:0cm;\" class=\"MsoNormal\">\r\n	<span style=\"line-height:2;font-size:16px;\"><strong>5.</strong></span><span style=\"line-height:2;font-size:16px;\"><strong>软文写作</strong></span> \r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"line-height:2;font-size:16px;\">借助文字来表达与传播企业的某种动态、观点，从而达到企业品牌宣传、产品销售的目的，相对于硬性广告而言，软文广告是由企业的市场策划人员或文案人员负责撰写的“文字广告”。</span><span></span> \r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"line-height:2;font-size:16px;\">更具公信力：新闻营销就是以新闻的视角、新闻的表现形式，完整、清晰地将真实、可靠的新闻事件向公众阐述清楚。并被多家媒体转载、报道，这样就更容易被受众所接受，所信赖。</span><span></span> \r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"line-height:2;font-size:16px;\">内容完整：新闻文章可以将时间完整的报道、阐述，图文并茂，使得受众对时间信息能够进行全面、完整的了解。</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<br />\r\n</p>','信息咨询业务介绍','');
INSERT INTO dou_page VALUES('20','expert','8','专家服务','<p class=\"MsoNormal\">\r\n	<img alt=\"\" src=\"http://company.nainaiwang.com/images/upload/image/20160324/20160324063520_72657.jpg\" />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 打造民族工业精髓的发展原则，充分发挥中国各行业专家诊断、治疗现存的工业发展的问题，实现工业强国的大理念。我们公司有中国工业改革创新顾问团队：企业管理咨询类、营销咨询类、品牌策划类、财务财税咨询类、法律咨询类、工业生产技术类专业人才，为您的企业排忧解难。<span></span> \r\n</p>','','');
