INSERT INTO dou_page VALUES('24','weal','9','公司福利介绍','<p>\r\n	&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-size:16px;\">员工福利</span></b><b></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-size:16px;\">5.1</span></b><b><span style=\"font-size:16px;\">法定带薪假期</span><span></span></b> \r\n</p>\r\n<p style=\"text-indent:21pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">元旦</span><span style=\"font-size:16px;\">1</span><span style=\"font-size:16px;\">天、春节</span><span style=\"font-size:16px;\">3</span><span style=\"font-size:16px;\">天、清明节</span><span style=\"font-size:16px;\">1</span><span style=\"font-size:16px;\">天、劳动节</span><span style=\"font-size:16px;\">1</span><span style=\"font-size:16px;\">天、端午节</span><span style=\"font-size:16px;\">1</span><span style=\"font-size:16px;\">天、中秋节</span><span style=\"font-size:16px;\">1</span><span style=\"font-size:16px;\">天、国庆节</span><span style=\"font-size:16px;\">3</span><span style=\"font-size:16px;\">天。具体放假安排以临时的通知为准。</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-size:16px;\">5.2</span></b><b><span style=\"font-size:16px;\">婚假：</span></b><span style=\"font-size:16px;\">符合法定结婚年龄的，公司给予初婚者</span><span style=\"font-size:16px;\">5</span><span style=\"font-size:16px;\">天的假期，婚假包括公休假和法定假（各分支机构所在地有相关政策的，根据当地的政执行）。婚假须在一个月前提出申请，并提供本人的结婚证复印件。</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-size:16px;\">5.3</span></b><b><span style=\"font-size:16px;\">产假：</span></b><span style=\"font-size:16px;\">女员工生育享受</span><span style=\"font-size:16px;\">98</span><span style=\"font-size:16px;\">天的产假。若是难产的增加产假</span><span style=\"font-size:16px;\">30</span><span style=\"font-size:16px;\">天；若是多胞胎生育的，每多生育一个婴儿增加产假</span><span style=\"font-size:16px;\">15</span><span style=\"font-size:16px;\">天，女员工怀孕流产的，根据医务部门的证明，妊娠不足</span><span style=\"font-size:16px;\">4</span><span style=\"font-size:16px;\">个月的，产假为</span><span style=\"font-size:16px;\">20</span><span style=\"font-size:16px;\">天，妊娠</span><span style=\"font-size:16px;\">4</span><span style=\"font-size:16px;\">个月以上的，产假</span><span style=\"font-size:16px;\">42</span><span style=\"font-size:16px;\">天（各分支机构所在地有相关政策的，根据当地的政执行）。</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-size:16px;\">5.4</span></b><b><span style=\"font-size:16px;\">丧假：</span></b><span style=\"font-size:16px;\">直系亲属（配偶、子女、父母、岳父岳母）去世，丧假</span><span style=\"font-size:16px;\">3</span><span style=\"font-size:16px;\">天。根据路程长短，视实际情况而定。</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-size:16px;\">5.5</span></b><b><span style=\"font-size:16px;\">生日祝贺：</span></b><span style=\"font-size:16px;\">行政部每月集中组织一次生日祝贺活动，向当月过生日的员工赠送有部门公司领导及其他员工等共同签名的生日贺卡一张或带有公司纪念意义的小礼品一份。</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-size:16px;\">5.6</span></b><b><span style=\"font-size:16px;\">社会保险：</span></b><span style=\"font-size:16px;\">15日（含）前入职可在当月办理社会保险手续，</span><span style=\"font-size:16px;\">15</span><span style=\"font-size:16px;\">日后从第二个月开始享受社会保险福利。具体执行标准参照国家相关规定执行。</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-size:16px;\">5.7</span></b><b><span style=\"font-size:16px;\">节日慰问</span></b><span style=\"font-size:16px;\">：公司根据实际情况，在每年的端午节、中秋节和春节发放慰问品。</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-size:16px;\">5.8</span></b><b><span style=\"font-size:16px;\">三·八妇女节</span></b><span style=\"font-size:16px;\">：所有女性员工可以休假半天。</span><span></span> \r\n</p>\r\n<p style=\"background-color:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<b><span style=\"font-size:16px;\">5.9</span></b><b><span style=\"font-size:16px;\">带薪年休假</span></b><span style=\"font-size:16px;\">：职工累计工作已满</span><span style=\"font-size:16px;\">1</span><span style=\"font-size:16px;\">年不满</span><span style=\"font-size:16px;\">10</span><span style=\"font-size:16px;\">年的，每年可休年假</span><span style=\"font-size:16px;\">5</span><span style=\"font-size:16px;\">天；已满</span><span style=\"font-size:16px;\">10</span><span style=\"font-size:16px;\">年不满</span><span style=\"font-size:16px;\">20</span><span style=\"font-size:16px;\">年的，每年可休年假</span><span style=\"font-size:16px;\">10</span><span style=\"font-size:16px;\">天；已满</span><span style=\"font-size:16px;\">20</span><span style=\"font-size:16px;\">年的，每年可休年假</span><span style=\"font-size:16px;\">15</span><span style=\"font-size:16px;\">天。工作年限以社保缴费证明为依据，每年的年休假最多不超过</span><span style=\"font-size:16px;\">15</span><span style=\"font-size:16px;\">天，国家法定休假日、休息日不计入年休假的假期，请病假累计</span><span style=\"font-size:16px;\">2</span><span style=\"font-size:16px;\">个月以上的不再享受当年的年休假。新入职的员工试用期不允许休带薪年休假，带薪年休假假原则上应在本年度休完，各部门负责人应合理安排部门的人员在下一年度第一季度休完上年度的带薪年休假。</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-size:16px;\">5.10</span></b><b><span style=\"font-size:16px;\">电脑补贴：</span></b><span style=\"font-size:16px;\">对因公司原因无法给员工配备办公电脑的，由员工自带电脑进行办公的，每月补贴</span><span style=\"font-size:16px;\">100</span><span style=\"font-size:16px;\">元，连续补贴</span><span style=\"font-size:16px;\">12</span><span style=\"font-size:16px;\">个月。</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span style=\"font-size:16px;\">5.11</span></b><b><span style=\"font-size:16px;\">健康体检：</span></b><span style=\"font-size:16px;\">每年秋季，公司组织所有在职人员在办公所在地进行健康体检，具体的体检项目和费用标准，以行政部的安排为准。</span><span></span> \r\n</p>\r\n<b><span style=\"font-size:16px;\">5.12职业装补贴：</span></b><span style=\"font-size:16px;\">为体现公司良好服务形象，经公司领导层批准可以由公司统一定制职业装，以定制职业套装的日期为准，转正的人员公司补贴</span><span style=\"font-size:16px;\">50%</span><span style=\"font-size:16px;\">，转正满</span><span style=\"font-size:16px;\">6</span><span style=\"font-size:16px;\">个月以上的人员公司补贴</span><span style=\"font-size:16px;\">100%</span><span style=\"font-size:16px;\">，对新入职的未转正人员，公司不予补贴，也不做必须装着公司职业套装的硬性规定。</span><span style=\"font-size:16px;\"></span> \r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>','','');
