INSERT INTO dou_page VALUES('28','connectway','10','联系方式','<p>\r\n	<span style=\"line-height:1.5;\">咨询热线：400-6238-086</span> \r\n</p>\r\n<p>\r\n	<span style=\"line-height:1.5;\">联系电话：021-60459865</span> \r\n</p>\r\n<p>\r\n	<span style=\"line-height:1.5;\">交易平台网址：<a href=\"http://www.nainaiwang.com\">http://www.nainaiwang.com</a></span> \r\n</p>\r\n<p>\r\n	<span style=\"line-height:1.5;\">总公司地址：<span style=\"font-family:宋体;font-size:12px;\">上海市浦东新区唐镇上丰路</span><span style=\"font-family:\'Times New Roman\';font-size:12px;\">977</span><span style=\"font-family:宋体;font-size:12px;\">号涛飞国际广场（电子商务港）</span><span style=\"font-family:\'Times New Roman\';font-size:12px;\">B</span><span style=\"font-family:宋体;font-size:12px;\">区</span><span style=\"font-family:\'Times New Roman\';font-size:12px;\">8</span><span style=\"font-family:宋体;font-size:12px;\">楼</span> \r\n</p>\r\n</span> \r\n<p>\r\n	<span style=\"line-height:1.5;\">北京分公司地址：<span style=\"font-family:宋体;font-size:10.5pt;\"><span style=\"font-size:12px;\">北京市大兴区大兴亦庄开发区文化园林肯公园</span><span style=\"font-size:12px;\">C</span><span style=\"font-size:12px;\">区</span><span style=\"font-size:12px;\">24</span><span style=\"font-size:12px;\">号楼</span><span style=\"font-size:12px;\">2504</span><span style=\"font-size:12px;\">室</span></span>&nbsp; 联系电话：010-67895968</span>\r\n</p>\r\n<p>\r\n	<span style=\"line-height:1.5;\"></span><span style=\"line-height:1.5;\">唐山分公司地址：唐山市路北区恒茂国际1号楼3单元2204。联系电话：13363269016</span> \r\n</p>\r\n<p>\r\n	<span style=\"line-height:1.5;\">阳泉分公司地址：阳泉市下白泉质检大楼；阳泉市河底镇工业园区。联系电话：0353-4204806</span> \r\n</p>','','');
