INSERT INTO dou_zhaopin VALUES('26','3','UI设计师','','','','1451959027','0','','0','面议','<p class=\"MsoNormal\">\r\n	1.产品序列目前划归技术序列，目前技术部无此类岗位人员；\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"line-height:1.5;\"> 2.完成</span><span style=\"line-height:1.5;\">2016</span><span style=\"line-height:1.5;\">创收任务和耐耐</span><span style=\"line-height:1.5;\">2.</span><span style=\"line-height:1.5;\">开发任务均需要</span><span style=\"line-height:1.5;\">2</span><span style=\"line-height:1.5;\">个美术设计进行工作支持。</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:21.0pt;\">\r\n	<span></span> \r\n</p>\r\n<br />\r\n<div>\r\n	<br />\r\n</div>','<p class=\"MsoNormal\" style=\"margin-left:0cm;\">\r\n	1.负责<span><span>软件界面</span></span>的美术设计、创意工作和制作工作；<span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:0cm;\">\r\n	2.根据各种相关软件的用户群，提出构思新颖、有高度吸引力的创意设计；<span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:0cm;\">\r\n	3.对<span><span>页面</span></span>进行<span><span>优化</span></span>，使用户操作更趋于人性化；<span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:0cm;\">\r\n	4.维护现有的应用产品；\r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:0cm;\">\r\n	<span style=\"line-height:1.5;\">5.收集和分析用户对于</span><span style=\"line-height:1.5;\">UI</span><span style=\"line-height:1.5;\">的需求。</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:21.0pt;\">\r\n	<span></span> \r\n</p>\r\n<br />','0');
